"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/OyNsh3FJNHLupV9DMMCEbg/l.jpg",
"rating":"4.0",
"reviewcomment":"Came her for a birthday &#34;dinner&#34; a few weeks ago.<br><br>We had reservations so were seated immediately. One complaint is that the tables are crammed pretty close together so the back of my chair was only a couple of inches from the back of the chair of the person seated in the table behind us. Hard to get in and out.<br><br>I wouldn&#39;t call the menu here &#34;cheap&#34;, especially for breakfast food but the portions are giant and easily feed two people in most cases.<br><br>I had the tower of waffles with the fried chicken. It was a giant plate of food and very good. I managed to eat about half of it. Chicken was very flavorful and the waffles had a giant slice of bacon baked into them!<br><br>Don&#39;t pass up the biscuits! Slathered with butter and honey...they are magnificent!",
