"rating":"4.0",
"reviewcomment":"This place is the best Indian/Himalayan restaurant in SoCal! I used to live in LA/OC and now SD, so I feel pretty strongly about that statement. <br><br>Ambience - simple, not too fancy, just right<br><br>Food - The food is the main story here! It&#39;s is delicious, all of it! First things first, they give everyone a bowl of daal to start which is delicious. Really a home made taste, just like my mom makes. Their main dishes are all good. This isn&#39;t like any other place, because they have unique flavors that are different from other Indian restaurant. That himalayan touch really makes a huge different. My favorite is the paneer tikka masala (note: I&#39;m vegetarian). It&#39;s creamy but balanced and appropriately spicy if you ask for it. And you have to get the garlic naan with it. But I also love the momos. They are really unique, light, and flavorful. Similar to dumplings. My husband loves the Chicken Makhani and the Goat when they have it. <br><br>Price - really reasonable. It makes for an affordable night out with big portions.",
