"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/eh69XECg-TWP2KliqaG_gQ/l.jpg",
"rating":"4.5",
"reviewcomment":"This is the place to take out of town guests EVERY TIME! My fiancé and I moved here from LA a few years ago and whenever we have visitors come down its a no brainer to take them here. I know that every time we come here the service will be great, the food is always amazing, drinks are great, the ambience is trendy but intimate and everyone will have a great time. Prices are reasonable especially when you consider the amount of food you&#39;re getting. <br><br>The drinks are very good but the wine list is a must. Everything is &#34;at cost&#34; and there&#39;s a large selection. <br><br>Favorite foods to recommend are the polenta ragu, beet salad, short rib pappardelle (drool just thinking of it), brussel sprouts, and stuffed zucchini blossoms. Most of those dishes are very rich and heavy but not overwhelming. <br><br>Things to know before you go: make a reservation well in advance! They book up quick. You can find them on opentable, but they ask for a credit card so it&#39;s better to call. They have valet but there&#39;s usually street parking.",
