"rating":"4.0",
"reviewcomment":"I have always been a fan of this spot since before the remodeling. I like what they have done with the place, and I&#39;m of course a fan of the ramen. I can&#39;t say that this is the best ramen I&#39;ve ever had, but it is my go-to in my hometown, and does the job when I have a craving.<br><br>Nitty Gritty: Much more spacious, so coming with groups isn&#39;t nearly as bad as it was before. The beer selection is decent and well-priced, especially during happy hour! The staff is friendly and you can bet that there is always a wait here. The ramen dishes are always served steaming and flavorful, although they don&#39;t really have a commendable vegetarian/vegan option due to the traditional nature of the dish&#39;s broth. The noodles are good here, and is probably one of the reasons I keep coming back. The fact that they stay open late, provide good service, and stay consistent earns them 4 stars at the very least.",
