"rating":"3.5",
"reviewcomment":"Great for groups or just for 2!<br><br>I&#39;ve been here several times over the past couple years and it&#39;s definitely one of my go to places for good food and service in Old Town.  <br><br>For smaller groups (under 8) it&#39;s fine to just show up and wait for a table to be available.  For groups over 8 I recommend making reservations.  I haven&#39;t had any issues with making reservations or making slight changes to them.  They have several rooms both on the ground level and upstairs to accommodate different group sizes.  <br><br>Last year I was here for a preset menu wedding dinner... had a blast!<br>Recently here for my birthday with a group of 20... had a blast!<br>Here for dinner with a small group of friends... had a blast!<br><br>Regardless of group size or occasion this place hasn&#39;t disappointed.  <br><br>So if you&#39;re looking for a place to bring people in Old Town or looking for a place to host you&#39;re a dinner, I definitely recommend this place. <br><br>For those passer byers... the fresh tortilla or amazing!  I&#39;ve stopped by just for those and it&#39;s worth it!",
