"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/IQ-nEdQXStDgeul8SWxRuw/l.jpg",
"rating":"4.0",
"reviewcomment":"I came in here after a volleyball tournament in OB because I heard they had the best fish tacos and wanted to see for myself.<br><br>The place was pretty packed and it was a little difficult to find a seat at first. They have a few different drink specials that change I believe every few hours so be careful about reordering the same drink since my waitress didn&#39;t tell me it had. They also didn&#39;t seem to be on their &#34;A&#34; game today but I wasn&#39;t here for the service. I was here for the fish tacos.<br><br>Now onto the reason I came here, the tacos. They were good but I don&#39;t think they are the best in town. I had one of the Mahi tacos which was just ok and I didn&#39;t think it had that much flavor. The second taco I had was the Baja Fish and that one was actually really good. It was nice and crispy and had a lot of flavor to it. The tacos actually did have a lot of fish in them but they weren&#39;t good enough for me to go out of my way to come back here.  I believe Shoreclub in PB has better tacos and normally is a lot less crazy busy compared to South Beach.",
