"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/0XjOc-Ym1Q_qZgYjspAL1w/l.jpg",
"rating":"4.0",
"reviewcomment":"She: I want bfast i think...The mission on J<br>Me: What time?  I still have a meeting at 8  should only be 20 minutes<br>She: Uhhh...8:30???<br><br>This was how the early morning text started...<br><br>@ 8:29<br>Me: Almost done!  Took longer than anticipated<br>She: Ummmm...ok?  you better hurry...it&#39;s getting crowded<br><br>Well, I didn&#39;t get there until about 9:20 cause the person I was meeting with wouldn&#39;t shut up, and I couldn&#39;t be my usual rude self.  Luckily, Yolie got a booth in the corner but the place was packed when I walked in.  I also have to thank the parking gods for getting me a space close by.<br><br>She: Welcome, did you need some time?<br>Me:  Need mimosa now...maybe two<br><br>I ordered the beef hash and eggs and we shared the French toast.  The beef was tender and flavorful and I love the crispy potatoes.  Yolie had the Mission Rosemary which came out with excellent toasted rosemary bread.  And yes, another mimosa was in order.  I ended up getting a cappuccino and I wondered from the cute flower shape, it was a hint to write a Yelp review.<br><br>Our server, Cara, was great!  Friendly and personable, and I found out she is studying at the Paul Mitchell school...so yes, I will probably go get my hair cut from her as well.  I loved the fact that they let us sit there for almost four hours talking.  I can&#39;t wait to come back!  However, I&#39;d probably want to come on an off day since I&#39;m sure the wait on the weekend can be pretty long.",
