"rating":"4.0",
"reviewcomment":"I love me some Crab Hut!!! I love shrimp and anything sea food. If I have to compare this place to Boiling crab I will definitely go here instead of there because <br>First, Boiling crab is too too far. Second the taste of their shrimp mix is better and Third I have friends that work here.<br><br>Couple of things I think they should work on is that the quality of the food has diminished. Just by looking at the sauce for the shrimp there seems to be no more garlic, and I know because I always order rice with the shrimp and i always put the sauce on my rice. I can say that the flavors that they use is not completely there compared to how it was before. Sometimes when I order crawfish it seems like they were frozen when it specifically says that they were suppose to be fresh. Maybe they expect us to not know the difference. The servers are always busy so it is hard to get their attention. The prices of this place has gone up, so don&#39;t expect to pay the same as what you did a year ago. <br><br>When it comes to the plaza in general it is always hard to find parking and make sure you know that you will have to wait for a seat at crab hut. Something I realized was that the line for the restaurant wasn&#39;t as bad as it was before. So maybe that shows you that the food isn&#39;t as great as it was before. <br><br>I assume that the Crab Hut in downtown is a lot worse when it comes to parking and finding a seat because it has a bar to order drinks and it is in downtown.",
