"reviewcomment":"11 years ago, I came to this restaurant because a friend said it was the best one in Little Italy; it held true to the statement back then, and it still does today. Everything is delicious--from the fresh tomato and herb sauce they serve with their warm bread, to their wine selection and their weekly specials, it is fantastic.<br><br>Though I have strayed, (only twice) to try different restaurants in Little Italy, I always come back. In fact, since my sister moved here 6 years ago, and one visit and she was hooked; we, have since, celebrated her birthday there every year.<br><br> I tend to stick to the same dish, their Ossobuco entrée is perfect every time with veggies or mushrooms and risotto. Their filet mingnon  is another go to and for a starter you can never go wrong with their carpaccio of the day. Love, love, love this place, a crowd pleaser in my book!",
