"reviewcomment":"Awesome Diner Food!<br><br>As a diner kind of food... it was great. If you don&#39;t like diner food... not the place for you.<br><br>Food: 5 star: I ordered the samson steak sandwich. I enjoyed the crunch of the bean sprouts with the juicy beef and melted cheese. Delicious!!! My husband had the monte cristo.... he liked it. It is definitely on the sweet side. Tasted more like dessert to me. He had a cookies n cream malt shake... I ordered coffee malt shake. I guess I don&#39;t like malt... it was gross to me. So the waitress gave me a regular coffee shake. It&#39;s coffe flavored. I&#39;ve had better coffee shakes... but it was prerry good<br><br>Service: 5 star: Amazing. Wow... I wish I remembered her name. She has great customer service. All I rememberes is that she had piercings on her face. She had one of those earrings that you can see a hole through. Anywho... she was very helpful and nice. Had a smile om her face the whole time. Thank you for the great experience. Servera can make a difference on how u enjoy the restaurant.<br><br>Cleanliness: 5 star: clean tables and utensils. Floors look clean also. They know how to mention their restaurant.",
