"rating":"4.0",
"reviewcomment":"I&#39;ve been here countless of times. This is easily hands down the best all you can eat korean bbq joint in San Diego (not that there&#39;s many to compete with).<br><br>The restaurant is clean and spacious. Servers, though some can&#39;t understand perfect English, but are all very friendly and attentive. Quality of the meat is good, banchan (the little side dishes) are delicious, salad is refreshing, and steamed egg is my absolute favorite! There are three tiers to choose from, A2 (basic $20), A1 (with seafood), and S1 (I never even bother looking at what S1 offers cus A2 already has more than enough options to choose from haha).<br><br>We always start off with brisket, then work our way through marinated short ribs, beef tongue, sometime bulgogi, then sum up everything with spicy pork belly. Don&#39;t forget to ask to change the grill once or twice throughout the meal!<br><br>Everything is all you can eat, so come starving!<br><br>Tip: You can also get half order of meat so you can try more of the different ones.",
