"categorystrlist":"Vietnamese,         Chinese",
"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/Th1zAQSooMVNAHkys8Vhfg/l.jpg",
"rating":"4.0",
"reviewcomment":"This place is much much more than pho joint. I mean, you can get pho here and vermicelli noodles and the rest of the usual suspects. However, they offer a treasure trove of traditional Vietnamese dishes, all of which, I cannot comment on. I guess I need to make some legit Vietnamese friends so I know what to order.<br><br>However, I will say that the beef cubes and fried rice are really good and something that you can&#39;t really get at other nearby pho places. The beef is always really tender and flavorful. Not the mention, the portions are very generous. The other item that I think really stands apart from other vietnamese places is their fried egg rolls. Super delicious! And they always come out piping hot (maybe a little too much so, as I&#39;ve burned my tongue more than once.) <br><br>The service is usually very nice! The one thing that is slightly annoying is the two credit cards per table rule, which can get kind of tricky when you have a big group, but hey, you can&#39;t have everything right?",
