"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/815d2e_MyN0m4fIJJZMWRg/l.jpg",
"rating":"3.5",
"reviewcomment":"I have been a fan of Sushi Deli for close to 10 years now, and it is my go to sushi place.  With that being said this place is EXTREMELY popular with about every type of crowd you can imagine, so be prepared to wait for a table unless you get there right when they open.  <br><br>Their food is delicious, their prices are reasonable, and the staff is attentive...what more could you want? <br><br>Their sushi rolls range from the normal run of the mill rolls to rolls you&#39;ll probably have a hard time finding other places, and they offer stuff other than sushi (like teriyaki chicken and rice).  <br><br>A little crowded, a little loud, but I wouldn&#39;t have it any other way!  <br><br>If you haven&#39;t experienced Sushi Deli, I highly suggest you give it a shot...If the inevitable wait doesn&#39;t appeal to you, don&#39;t worry you can always call and order it to go and have a sushi picnic on your living room floor, which is what I do when I don&#39;t want to deal with the wait or the crowds!",
