"rating":"4.5",
"reviewcomment":"This place is awesome. The ambiance is just one of a kind (in the most wider full way possible). The decor is beautiful with Eastern lamps and rugs everywhere. The music is a great music setter. Great for dates if you want to make a classy impression. There are many vegetarian  appetizers, props because they are tasty as well. I came here for happy hour and dinner with a friend on two separate occasions as she&#39;s always raving about how wonderful the place is (I totally agree).<br><br>Notable specials: <br>Happy hour is as follows: <br>Su-Th 5-630p &amp; 9:30-11p.<br>Fri &amp; Sat 4-6p &amp; 10-11p.<br>I remember really enjoying the Moroccan kiss ($5 I think), very sweet and bubbly drink. The tomato &amp; cucumber and potato salads were very tasty too.  <br><br>Meatless Mondays: 25% off vegetarian dishes. The vegetable tagine is kickass. Very flavorful with earthy spices (so it&#39;s not spicy). It had a very strong tomato base to the curry used. I also really like the spiced carrots that come with the meal. <br><br>Definitely coming back.",
