"reviewcomment":"Came to the restaurant about 9:15 am on Memorial Day weekend. 20 minute wait, no big deal. Ended up being about 15. <br><br>We sat at the bar inside and were greeted immediately to take our drink order. Then when we placed our food order, it came out really quick. <br><br>Food was delicious! We got the banana French toast and Jose&#39;s special (basically scrambled eggs with veggies and potatoes). Loved them both!! Will absolutely come back for the food :)<br><br>The reason why it&#39;s 4 stars? I don&#39;t know if it was because we sat at the bar in the middle of all the action, but everyone was running around us so fast, I felt rushed. I was scarfing my food down like it was timed. The check was given less than 5 mins after we got our food, and everything was happening so quickly, I didn&#39;t feel like we got the chance to relax and enjoy our food. When I looked at the clock when we left, we were in and out of this place in less than 30 mins. I didn&#39;t realize until we left just how stressed I felt from the chaos.",
