"reviewcomment":"Beautiful restaurant! I&#39;ve been here multiple times on various occasions. The second level bar/restaurant area is great for happy hour or just a casual dine with friends on the weekend, and the terrace upstairs is absolutely stunning for a sunset dinner, with ocean views and breezes.<br>The menu is seasonal, so although I liked everything I ate there, I can&#39;t make any particular recommendations. But i definitely enjoyed their gnocchi dish and salmon dish- the salmon tasted much fresher than any I&#39;ve had at area restaurants.<br>Note that it&#39;s cheaper to eat on the second level- their drinks and food are marked down somewhat. Also, it&#39;s going to be crowded pretty much all the time, regardless of where you&#39;re seated, so don&#39;t expect too much of an intimate meal.",
