"reviewcomment":"One dolla make you holla!<br><br>For some oysters at PB Fish Shop, that is.  Thursday evenings offer $1 oysters, 4pm-til they run out.  They had about 5-6 different types when I went (Ican&#39;t remember all the names, except for Kumiai, lol).  <br><br>FOOD:<br><br>-Oysters - Fresh and yummy, depending on which you order (read the descriptions on their oyster list first).  I can usually eat a dozen, but the ones here seem a lot bigger, and I wasn&#39;t able to finish it all!<br>-Lobster Lumpia - yupppp you heard right! Crispy, lobster-filled  egg rolls with jasmine rice and sweet chili sauce for dipping.  (Btw, an order of 4 is cut into halves, so more like 8 pieces).<br>-Garlic Butter scallop plate - About 5 pieces of fresh scallop, seared with garlic butter; I chose seaweed salad an onion rings as my sides (the house onion rings are huge!).<br>-Sculpin beer - no need to explain<br><br>SERVICE:  Friendly and fast!<br><br>*TIPS*<br>-To order combos:<br>1) choose your fish of choice<br>2) What kind of sauce do you want it cooked in (I chose garlic butter)<br>3) What kind of entree (in a taco, on a plate, etc).<br>- To order oysters, go inside and tell them how much you want.  Pay there, then they give you tickets and you go outside to the oyster bar to redeem them =)<br>-Line starts to get long after 5pm-ish<br><br>One more note.  I ordered up a storm at the counter....24 oysters and 2 scallop plates.  Came up to about $75.00!  So beware....there are no prices listed for the fish ;)",
