"reviewcomment":"I&#39;ve been to this place more than I care to admit, and enjoyed it every time... except my first time here. The aroma of place was off-putting for me at first, but I&#39;ve grown to not mind it.<br><br>My boyfriend swears by their broth for a feel-better-from-all-sickness remedy. We always get the half spicy - half not spicy soup base. The spicy side, despite being filled with red peppers isn&#39;t all that spicy. But not to fear fellow spice-lovers: you can request for more spicy soup base and they&#39;ll bring you extra chili peppers in oil, and you can adjust the spicyness level by the spoonful. The boyfriend also always requests the three sauces you can get on the side, and then he mixes all of them, which is something not really to my taste, but hey he loves it! Hahaha. <br><br>The food options are pretty straightforward and are what you would expect. Sometimes they run out of watercress, my favorite veggie on the menu.",
