"reviewcomment":"Farm to Table upscale mall eatery.<br><br>Organic, seasonal, and health conscience friendly.<br><br>Ordered the Grass Fed Bison Burger. Wheat bun, unami, watercress, and mushrooms with a caramelized onion spread. Sided with a choice of sweet potato hash or kale salad. Opted for the hash which was essentially O&#39;Brien Potatoes with sweet potatoes guest starring in the lead role. Hearty but not heavy lunch.<br><br>For sweets, I ordered the flour-less chocolate cake. A common dessert player on many menus, TFK&#39;s stood out with the use of organic 72% cacao woven into the cake, riding on a wave of sinful salted caramel. Rich decadence and an epiphany to chocoholics.<br><br>Fairly guilt free meal to fuel a shopping excursion.",
