"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/VSWlj41yr_LEX1iT22DujQ/l.jpg",
"rating":"4.5",
"reviewcomment":"Truluck&#39;s was located literally right across the street from my hotel. After numerous San Diego yelpers recommended it, I knew I needed to try it. <br><br>Let me just say, this meal was PHENOMENAL.  It definitely was a great way to introduce myself to pacific coast seafood. <br><br>Upon entering, it had a loungy type feel. There was live music that was a nice touch. Nothing overbearing. <br><br>I was seated in a cozy booth in the bar area and immediately my server brought over a bottle of water. <br><br>After perusing the menu and asking for his recommendations, I went with the mussels appetizer, the mesculin greens and the miso glazed seabass. All were fantastic and exactly what I was looking for, but the seabass is where it&#39;s at. In fact, I&#39;ve contemplated going back again to have the exact same meal. <br><br>The seabass was atop a bed of crab fried rice. This too was fantastic and complimented the seabass. On top of the seabass was a cucumber salad. It sounds like an odd combo but the flavors blended very well together. <br><br>My server told me Truluck&#39;s is from the Naples area. I&#39;m excited to look them up upon my return to florida so I can recreate my exceptional meal.",
