"rating":"4.5",
"reviewcomment":"I&#39;m back in town this week visiting for my girlfriend&#39;s business and we decided to check out BANKERS HILL. Cool spot right on the corner on, waddya know, a hill. The place has a very chic hipster vibe, with unique art all around, big stable-style doors and a really nice patio with a vertical garden.<br><br>We sat at the bar first and ordered a few cocktails from the main bartender, Christian. He was telling us all about his travels throughout the world and what the different ingredients in each drink represented; there&#39;s a lot more there than meets the eye! For dinner I went with the BANKERS HILL Burger and WOW was it good! Like a butter burger with great flavor. I had to fight my girlfriend off from stealing bites. The truffle fries were so rich, too. She ended up eating most of those...<br><br>BANKERS HILL seems to have a cool growing vibe and I&#39;ll definitely try to return next time we&#39;re in town. Great place to take a date, gather with a few friends or even go solo and hang with my guy Christian at the bar.",
