"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/RE6Pogt_hHaMDCfejSTCsA/l.jpg",
"rating":"4.0",
"reviewcomment":"Holy F if I could give this place more stars I would! We went here today after our zoo trip on a recommendation from my friend who lives in S.D. and we were so glad we did. I don&#39;t normally write reviews right after I go somewhere but I was so happy about everything about this place I felt compelled.<br><br>Ok enough yapping. So we got to this place and it&#39;s a seat yourself situation. So we waited awhile and stalked a table and stared at them for a good amount of time. One of the ladies that worked there saw us waiting so she came and put a reserved sign on the table so we could get the table as soon as the people left. Awesome GREAT customer service considering people were waiting everywhere. <br><br>Riki was our server and she was great! We started with some beers we got Ballast Point Calico and The Coronado Brewing Company Golden Pilsner. Great Beers! Their special for the night was the Chili Cheese Tots and those were spectacular! The tots had a perfect crunch to them the chili was so flavorful and it was so yum. I got The Farmers Market Salad and I can&#39;t stop thinking about how friggin good this salad was! It had everything in it! Beets, Carrots, Cucumbers, etc in a homemade Thyme Vinaigrette! So amazingly fresh and delicious! The rest of my family ordered either the salad or cheese burgers and everyone was so happy! Not only did this place have great customer service, great beers and great food it was extremely kid friendly! And the prices were so cheap! You would never be able to get food that good and that cheap in Orange County!!! A++++++ across the board!",
