"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/tpEozl-YhYGbDG_MJkQYuQ/l.jpg",
"rating":"4.0",
"reviewcomment":"I&#39;m so behind on reviews it&#39;s ridiculous. Just had to get that out of the way.<br><br>I was apartment hunting like a month ago and one of the complexes we checked out was right by Sab-E Lee and my soon to be apartment suggested we eat there &#39;cause it&#39;s delicious! So we did.<br><br>PARKING:<br>It&#39;s in a little plaza. Kind of small, We didn&#39;t have any issues with parking.  Though we did show up RIGHT before they opened for their dinner hours.  We didn&#39;t know they had a one hour gap where they were closed.<br><br>AMBIANCE:<br>Super tiny place.  Probably can seat like 15 people max.  It&#39;s not the cleanest but I don&#39;t mind.<br><br>SERVICE:<br>The lady at the cash register was nice.  I believe they ONLY TAKE CASH, so make sure you got some.  <br><br>FOOD:<br>I decided to get some red curry. Spicy level 5.  They suggest 3 as medium I believe and 5 they say is really spicy.  I wonder what 10 feels like.  It definitely had some heat but it was a good heat. I enjoyed it.  I love spicy food.  Maybe each time I go back I&#39;ll raise the level by 1 haha.  <br><br>The flavor overall was nice.  Good balance, veggies were nice in there.  Rice is extra unfortunately.  We also got our food to-go but it was no big deal and didn&#39;t really affect the quality.  <br><br>If we move down here, I will definitely visit more often!",
