"reviewcomment":"If you&#39;re looking for a lunch spot in La Jolla, don&#39;t look further than Brockton.  Cute little restaurant next to the La Jolla coves, but be prepared to circle around to find parking.  I came here on a Thursday and parking was near impossible, I circled back three times only to finally give up and park up the hill, give or take a 15 minute walk.<br><br>But once you get seated, the view is absolutely breathtaking.  If you ask, they&#39;ll seat you outside and you can see the coves from a bird&#39;s eye view.  You MUST get the clam chowder, listed on their menu as &#34;Epic Chowder&#34;.  I think the saffron cream is the difference maker than any of the other clam chowders I&#39;ve had.  Words really wouldn&#39;t do it justice how delicious this was, you&#39;ll just have to try it out!  The lobster roll is also a big hit; the bun was toasted perfectly and the lobster was fresh.  Can&#39;t wait to come back here.",
