"rating":"4.0",
"reviewcomment":"My husband and I tried this place for lunch and it was excellent. When you walk in you see these fabulous over the top gold mirror mosaics and I know it&#39;s a little much but I LOVE them. Our waitress was prompt and very nice. <br>      I ordered my meal to be a level 7 heat and it was pretty good. I love spicy so I could go hotter myself but 7 wasn&#39;t too shabby. My husband ordered his meal at heat level 8 and said the same, could but we could handle hotter. Since this was our first time we ordered conservatively on the heat level. <br>      The lunch quantity was very good. It had a small salad with a sweet dressing, a cup of soup and a spring roll to go with your main meal choice. I felt the prices were very good for the meal I received. I will definitely be back. Can&#39;t wait to try it out for dinner and follow it up with mango and sticky rice!",
