"reviewcomment":"Come during happy hour! Draft beers are $2 at 4pm and go up $0.25 every half hour. Happy hour happens 7 days a week.<br><br>That said, you may not always get the beer you ordered, and you may not always get the meat that you prefer in your food. My mom and I shared beef nachos and had a bit of shrimp on our plate, which makes you wonder if they are pre-making food to have ready to go out quickly. We ordered three different draft beers that didn&#39;t end up being what we ordered. The waitress acted completely oblivious the first time, so we went directly to the bartender the 2nd and 3rd times. Both of those times, the bartender just said &#34;oh yeah, we are out of that so I just poured you something similar.&#34; Wouldn&#39;t that be good to share with the waitress so she can inform the customer upon delivery?",
