"rating":"3.5",
"reviewcomment":"TOTS! TOTS! TOTS! STOP STARING AT MY TOTS! I&#39;ve been wanting to try this place for a long, long time! Finally made my way over and as much as I was thoroughly satisfied with my food, I can&#39;t come here all the time! The fear of big Brenda is real!<br><br>My first trip to R Gang eatery was a meal fit my a food loving heart. I ordered the cap&#39;n crunch stuffed french toast. Too be quite honest there was too much the cream cheese filling for me, BUT it was delicious. I would, for sure, order it again and ask for easy on the cream cheese. Also ordered at the table was pacos, which was a little TOO different for me. I&#39;m not too adventurous to try pancakes wrapped with eggs, chorizo, and potatoes, but my friend was. Her only complaint was the pancakes were a little too soft for her, but the chorizo was very good. <br><br>We couldn&#39;t leave without trying &#34;world famous house made tater tots!&#34; We gave the cheddar and chive a go round for our first visit since it was the R signature. If you are a reader of my reviews you know I am a lover of all things potato. These tots earned there &#34;world famous&#34; title!!! I&#39;m can&#39;t wait to lose a few lbs and come back to fatten myself up with some more tots!",
