"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/7PYXUabki7Gwp7FxWBxRAQ/l.jpg",
"rating":"3.5",
"reviewcomment":"Memorial Weekend: CHAOS! But... I almost felt like VIP because I greeted by the host and less than one minute, we were seated down with a waiter waiting to take our drink orders! Wait!! Do we look like celebrity look-a-likes?! Don&#39;t think so, but got outstanding service!!<br><br>The hardest and most frustrating thing about Cheesecake is deciding on WHAT TO EAT! When you&#39;re starving, everything sounds delish, but I settled on the Spicy Chicken Chipotle Pasta! I laughed when he brought the plate because it looked like one of those giant salad bowls filled with pasta galore!! The difficult part about the pasta was trying to not make yummie noises while eating it because it was delicious! It was something different, but amazing! <br><br>You would think that would be enough!! But we decided to save our leftovers for a midnight snack and get the Chocolate Brownie Sundae! We didn&#39;t order any alcoholic drinks, but we got chocolate wasted from this! I took a few bites and I was done, a bit too much for me! I would rather have something light and fluffy, not really dense considering I just gorged myself on carbs! <br><br>If you&#39;re a SoCal resident, everyone knows Cheesecake is just a classy version of BJs &amp; better!",
