"rating":"4.0",
"reviewcomment":"I like it!<br><br>A large array of Japanese food options, with a friendly and honest staff. All the restaurants in this area have lots for parking, but as you might now it gets packed during lunch and dinner. However you can normally find at least one spot!<br><br>Got seated for lunch quickly, and had quick service as well. We were about to order the seaweed appetizer, but our server told us that she doesn&#39;t recommend it because it tastes really bland -- yay! Love it when this happens.<br><br>The crunchy roll was REALLY good, possibly one of the most flavorful ones I&#39;ve ever had. Gyoza was gyoza, typically good. The chicken and calamari katsu was good, and surprisingly moist on the inside which is good. These entrees come with a bowl or rice and miso soup, both of which are really good as well! <br><br>I recommend this place for an affordable Japanese meal.",
