"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/cFEofX-gB_xFHRIQOi5j9Q/l.jpg",
"rating":"3.5",
"reviewcomment":"We arrived on a Monday morning at 10:00 am. We were greeted &amp; welcomed to sit anywhere we wanted to. Multiple people stopped by to check on us, take our order, deliver our food &amp; re-fill our coffees. Service couldn&#39;t have been any better. <br><br>I wanted pancakes but ended up ordering chilaquiles and chose beans vs. potatoes. The chilaquiles arrived at the table already seasoned to a medium-hot. If you can&#39;t take the heat, you may want to ask for a side of sour cream. In perfect form, some of the chips were still a little crunchy. It was a really delicious &amp; lively plate of food. I couldn&#39;t finish it all. <br><br>I tried to talk the Mr. Into ordering the 2x2x2 for $7 but he wanted potatoes, so he chose the mega breakfast. Holy moly that&#39;s a kit if food! We struggled to got everything on the table. I got to steal half of his pancakes and my oh my, they were tasty! I wish I could figure out how to make pancakes like that. <br><br>It&#39;s a semi-classy little place. I wasn&#39;t in the mood but they were concocting some tasty looking drinks at the bar. I think this would be a fabulous stop just about any time if the day or night!",
