"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/UpwN7VDiMhVVY4GUfC4shQ/l.jpg",
"rating":"4.0",
"reviewcomment":"I had an amazing customer service experience that I had to share. First, I should say that the food at Prepkitchen is fantastic, I would give that 4.65 out of 5 stars. The customer service experience took the whole thing to a solid 5 stars.<br><br>Our waiter Caesar A. was very friendly and interested in what we were all about. He quickly found out that I was planning a trip to Madrid in the near future. Later in the meal he sent over some chorizo stuffed, bacon wrapped dates free of charge to get us &#34;introduced to the food in Spain&#34; which apparently hast he best sausage int he world. <br><br>That&#39;s not where he went above and beyond, though already that was pretty good. Later he asked for my email address because it just so happened he is very familiar with Madrid and ahd recently written a quick guide for his brother or a friend. He was going to forward it on to me... my first thought &#34;yeah right, nobody ever follows up on stuff like that&#34;<br><br>I received the guide yesterday, with an invitation to come back and tell him all about the trip. <br><br>That type of service rarely exists any more, he was genuine and he followed through. For that alone I&#39;ll keep coming back even if he&#39;s not my server, any restaurant that highers that quality of people deserves my business.",
