"reviewcomment":"I&#39;ve been to this location a handful of times while visiting my friend in SD.<br><br>First of all, I love love LOVE the names of the drinks.  Hearing the employees yelling things like &#34;Polar Bear!&#34; makes me laugh.<br><br>The coffees are good, and the cheesecake is amazing. <br><br>I&#39;ve written 7 page blogs here, simply inspired by the atmosphere.<br><br>Then there was the night that my friend&#39;s roommates were being scary and violent on drugs...I was supposed to spend the night there and leave in the morning, so we&#39;d been drinking....some friends picked us up and took us to Lestat&#39;s at 2 in the morning, so we could drink coffee, eat, and sober up.  You have to love a 24 hour coffee shop.<br><br>I look forward to my next trip to SD so that I can come and enjoy this place again.",
