"categorystrlist":"American (New)",
"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/otslor_S65qeQtfUhq_dWg/l.jpg",
"rating":"4.0",
"reviewcomment":"Wow, talk about huge portions. My girlfriend and I started off with an order of the Carne Asada Nachos and they were great. Huge amount and very tasty. We couldn&#39;t even finish all of them. For our main we got the Flat Iron Chimichurri and we could not have been more satisfied. We got it cooked medium which was the right amount in my opinion and it comes with so much. On the plate was a salad, tomato and cucumber pico de gallo, black beans, chili honey glazed quesadilla and am amazingly tasteful Chimichurri sauce which paired perfectly with the streak. All this food was plenty for us to share and we were pretty hungry when we walked in too but our server blain convinced us to get a dessert so we went with the most popular one which was the Chocolate Caueta Vulcan. What a huge dessert and so perfectly and beautifully prepared. A table of 4 could easily share this brownie, ice cream concauction. <br><br>The Food was great and the service was even better. Our server Blain took great care of us and was on top of everything. Cant wait to be back.",
