"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/LISe5cTWXjBHM6VM7Dw-9A/l.jpg",
"rating":"4.0",
"reviewcomment":"I&#39;ve eaten at Evolution Fast Food many times over the years and LOVE IT.  In fact, it&#39;s the one place I continue to return to during every trip to Sand Diego.  Below is my review from 2011, which still stands as EFF continues to make super tasty food:<br><br>I ate at Evolution Fast Food last weekend and was impressed overall. I never know what to expect with vegan fast food places but this one exceeded any expectation I had. I ordered the Bacon Cheeseburger with regular fries - I believe it came with Daiya, Vegenaise, tomato, lettuce, etc. - and my friend ordered the South of the Border Burger with sweet potato fries. We paid at the counter and proceeded to the dining area (it was huge) and found an outdoor patio to sit at - we really enjoyed the patio and appreciated the beautiful flowers surrounding it. I have no complaints about my burger because it was GREAT!!! The patty and toppings went together very well and left me wanting more (but there was no way I could eat another burger). My friend also enjoyed her burger and loved her sweet potato fries, which looked more like chips to me. To top it off, the food was soooo cheap! I definitely recommend EFF for your next vegan fast food fix!",
