"rating":"4.0",
"reviewcomment":"FIRST IMPRESSIONS:<br>Loved the host stand at the entry; it was a shell of an old radio/hi-fi system. Attentive + friendly staff. Quick to be seated. Interior is moderately loud, but not overpowering to be unable to hear your companions.<br><br>Nifty perk: If you come here before a show, you get direct access to the Birch Northpark Theatre!<br><br>THE EATS:<br>Kale Caesar -- bright, light, dressing + toppings don&#39;t overpower the flavor of the baby kale. Some might prefer covering the woodsy kale flavor more, but I find it very pleasant + refreshing<br><br>Veggie sliders -- Smokey, savory, full of flavors from their fantastic house-made veggie patties + topped off with arugula, tomato + a chipotle aioli adding just a hint of heat. Definitely a favorite I&#39;ll order every time I come here.<br><br>All this was washed down with a delectable Belching Beaver Peanut Butter Milk Stout. Can&#39;t complain in the slightest. Lucky me for getting here just before Happy Hour wrapped up!<br><br>Ashley is sweet as can be + attentive. I wasn&#39;t sitting waiting for long before she&#39;s magically reappear to check on me.<br><br>THE VERDICT:<br>GO! -- Great food. Fantastically friendly servers. Great ambiance, decor, + decidedly &#34;West Coast&#34; vibe.",
