"reviewcomment":"I went here on Mardi Gras because Betty&#39;s was too packed, but I&#39;m sure glad I did! <br><br>Here are some highlights:<br><br>1. The salsa bar is delicious and has a creamy tomato jalapeno salsa that is the condiment version of crack.<br><br>2. They have steamed tacos.. wasn&#39;t sure what these were until my friend Matt ordered them, but they&#39;re basically like corn tortilla enchiladas and they are DELICIOUS!<br><br>3. The potato taco is sinful. Straight up mashed potatoes enveloped in a crispy tortilla shell.<br><br>4. The guac is fresh and tangy. Delicious as an app.<br><br>The lowlight... was probably the queso fresco tasted a bit off, but I could be biased because I&#39;m not a fan of that type of cheese or oaxacan cheese. <br><br>Friendly staff, $3.50 beers on Tuesday and Cumbia playing overhead, what more could ya want?!",
