"rating":"4.0",
"reviewcomment":"Tried this place for the first time with my boyfriend last night, and we were both pleasantly surprised.  We got edamame, avocado tempura, sushi combo, and the okonomiyaki.  <br><br>Edamame: Basic stuff, can&#39;t really mess it up.<br>Avocado tempura: I liked the idea more than I liked the taste.  It could use some lime juice or something to kick the flavor up a notch.  Should have gone for the shrimp in hindsight, but it wasn&#39;t bad.<br>Sushi combo: Seven pieces of nigiri and four pieces of a California roll.  It was pretty decent all around.  This is not really a sushi joint, and you can get better elsewhere, but still nice.<br>Okonomiyaki: This was the crown jewel of the evening.  I had never had it before, and I was blown away.  SO.  GOOD.  I wish I had some right now!<br><br>It didn&#39;t turn out to cost nearly as much as we imagined it would be, which was awesome.  I can&#39;t wait to go back and try those German fries.",
