"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/NiFrQqchVGxEkJh45GY8mw/l.jpg",
"rating":"3.5",
"reviewcomment":"Finally tried a taco Tuesday spot by my new living situation and I am in L-O-V-E. I knew I could count on yelp to lead me to the fabulous place. Not only was the food amazing but the service was SUPER-B.<br><br>We walked in on a Tuesday, apparently one of their busiest nights and were asked if we had a reservation. Surely we didn&#39;t but that didn&#39;t stop the server, he seated us right away next to a nice window booth seat. <br><br>Our server (I can&#39;t remember her name - but was so vivacious and bubbly). My friend is allergic to a multitude of things that the dishes have so we have to substitute or ask for it on the side. The server made notes of all the allergies, double checked with the chef that nothing would be cross contaminated and made sure none of the meats would be marinated in any of her allergies, and special made her margarita so that it safe for her to drink. <br><br>Once we ordered, our food was out in exceptional time and so were our drinks. The drinks were amazing and diverse, but I am sure you read it in a lot of other reviews or seen the photos.. so I won&#39;t get into that.<br><br>Food: STEAK, marinated in a this yummy juicy teriyaki marinated, the salmon taco was to die for in this thai miso salad topping. Those two tacos were my show stoppers and I am practically salivating writing this review talking about them.<br><br>I only tried the tacos for food but I definitely give it 5 stars, I would like to come back for maybe breakfast and try it out as I see my fellow Yelpers who have only tried breakfast and not their tacos. <br><br>Service: 5 stars - if you had a bad experience, I highly recommend you come again and give it another try.<br><br>Ambiance - retro, funky, colorful, Mexi-style. Love it.",
