"reviewcomment":"So I&#39;m a huge huge fan of cheeseburger. If I hear about a good burger place, I always make it a priority to visit the place next time I eat out.<br><br>My first impression of the Lounge burger was that it seemed too healthy for my taste. I like my burger greasy and juicy, dripping with the patty grease. Well, it wasn&#39;t juicy enough. But what actually impressed me was that the aftertaste of the burger was very good. It didn&#39;t overwhelm my taste bud too much with he flavors. The burger also did not put me to sleep after I finished them. Everything is organic and the beef is supposed to come from grass-fed cows.<br><br>If you like to enjoy a burger without worrying too much about the calories and the grease, this is a good place to give it a try.<br><br>note: Hard to find a seat during busy hours. This place is packed with people.",
