"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/HBF-V9PtCZQvvngzmTiktQ/l.jpg",
"rating":"4.0",
"reviewcomment":"DELICIOUS!!!!! Born and raised in the OC, I had my fair of Vietnamese food/restaurants. I must say that I am quite impressed.  This place blows them out of the water. First of all, the ambience was not your typical Vietnamese restaurant. The people here are friendly. They chatted with us, asked how the food was and the service was excellent (I got refills on water without asking!!!). As I said, not your typical Vietnamese restaurant. We ordered a few drinks and you&#39;ll definitely get your money&#39;s worth haha. The drinks were really strong but at least you&#39;ll know they aren&#39;t skimping out on the alcohol.  <br><br>Now onto the more important matter...the food. We ordered a lot of dishes because we were hungry and we finished everything....it was that good. We got the crab cakes, coconut shrimp, garlic shrimp, 360 beef, creamy basil sea bass, lo mein, and another chicken dish with veggies. The crab cakes, lo mein, and the chicken dish were good. It tasted like what you would expect from any other Vietnamese place. The coconut shrimp came out in a coconut and it was really good. The coconut sauce was sweet. The garlic shrimp remind me of a honey walnut shrimp. It was crispy texture. The 360 beef was cooked perfectly. It was soft and tender. The creamy basil sea bass was soooo good we got another order right after we devoured the first one.",
