"rating":"4.0",
"reviewcomment":"This review is for the sunday brunch. <br><br>Fantastic food! Amazing service! Adrian kept our bottomless mimosas filled at all times. Perfect balance of orange juice to champagne for $9 from breakfast to 2 p.m.! Not even light handed on the pours!<br><br>Oatmeal comes with dried currants, brown sugar, and candied walnut. Super hearty and good. <br><br>Two egg special is fantatic. Not too greasy but still flavorful. The bread looked dry, overly healthy, and nutty but was actually super delicious!<br><br>Wedge salad is normally not something I rec, but this place has a fantastic wedge salad. The dressing to bacon to bleu cheese ratio was perfect!<br><br>All of the food is super fresh and super well balanced in flavor. Our table of 6 had no complaints for anything! Other than we couldn&#39;t take Adrian home with us...<br><br>Super nice ambience, connected to the Sofia hotel, walkable from the train station. Would love to come back for dinner!",
