"rating":"4.0",
"reviewcomment":"So three part review here. First off. The look of the place. At first glance, seeing it from the outside you may think it&#39;s not that nice looking. But when you walk in, totally different vibe. Very nice looking and unexpected. Legit seating and booths. Their cups and plate don&#39;t look like your typical restaurants. So it&#39;s a really nice feel to it.<br><br>As for the restaurant itself. Now I can&#39;t say for all waitresses but ours was very nice. She didn&#39;t bug us while we ate. She got our ordered and drinks after we settled down. And even cleaned a booth for us so we can have more room. After we got our stuff. She came back at an appropriate time to ask if everything is okay and if we need refills and didn&#39;t constantly bother us like most places do.<br><br>And now. The main stuff. Food. <br>It was good. The meat was very tender which was a definite positive, it was very juicy but the bbq sauce did over power the taste a bit. The fries had a great if not perfect amount of seasoning to the point you don&#39;t even need to add ketchup or salt. <br><br>Overall a very good establishment. Would recommend it to anyone who enjoys a fine burger. And if you hurry there is a groupon for it right now which&#39;ll save you a lot. Happy eating.",
