"categorystrlist":"Chinese,         Asian Fusion",
"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/k0F-82OXumzkluvnD3D_6w/l.jpg",
"rating":"3.0",
"reviewcomment":"Tea station has always been my go to place for legit authentic Boba. Once I had boba in Taiwan, nothing in San Diego could even come close except for tea station.<br><br>They use quality tea here and you can really taste the difference. Their drinks aren&#39;t as sweet as compared to tap ex but that&#39;s what I love about this place. Not only is is the perfect sweetness already you can adjust your sugar level from no sugar to even 1/4 sugar. Their food is pretty standard Taiwanese fare. I rarely eat here so I can&#39;t really comment on the food.<br><br>Only problem is how expensive the drinks are here. Close to $5 for a regular milk tea with boba. Again since this is my favorite boba place I don&#39;t really mind paying that much. If you buy one of their plastic reusable cups, you can get a discount on drinks every time you come. I think the discount is like $.25.",
