"reviewcomment":"We had out of town guests, and we decided to try a new(for us) place on the waterfront for lunch on a Saturday. <br><br>We started with wine and cocktails. Tom Hams has a nice selection of wines, local craft beers and cocktails.  We chose Cakebread Sauvignon Blanc, a Chardonnay, a Bloody Mary and a Captain Idiot.  The drinks were all tasty and refreshing (side note: their bar has a nice view of the Harbor - think Happy Hour in the future).<br><br>Two of us ordered the Crab Louis Salad which had fresh-tasting crab and was the perfect amount for lunch.  I tried the lobster roll, and it was quite good as well, although I would have skipped the finely chopped red bell pepper.  The Crab BLT and the Lighthouse French Dip rounded out our orders, and all of them were tasty, unique and the right amount for a solid lunch.<br><br>A few of us had a little room for dessert and we split the Blondie sundae and a special that day which was essentially a tiramisu bread pudding.  The desserts were wonderful, and a great finish to a nice lunch for the family.<br><br>The view was spectacular on a sunny San Diego day.  We would recommend this to anyone (visitors and locals alike).  We will be going back soon.",
