"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/-0h90JLNR0vhnNysWtUayA/l.jpg",
"rating":"4.0",
"reviewcomment":"So, my Boyfriend Cecil and I came here around Eleven on the day of his Birthday. Right away we were greeted and sat. On the way to our table it seemed like everyone in the Bar knew it was his Birthday with everyone shouting it and greeting him. We were greeted by Fabian. (I hope I remembered his name right.) He was very nice and helpful. I didn&#39;t know what to order alcohol wise and he told me not to worry about it that he&#39;d bring me something great. (And he did!!) We also tried the Chipotle Fries and the Sliders which both dishes were superb! We then were waited on by a different girl, I think her name was Stephanie. She was amazing and attentive also.<br><br>Overall, they have great food, and drinks.<br>I will definitely be back. I will definitely be telling people about The Waterfront. <br><br>Oh yeah, and I appreciated the fact that everyone in the Bar took care of my Boyfriend on his 21st Birthday and made him feel special. He had a great experience and a great start off to his Birthday! You took care of us and I really appreciate that. And for that reason alone I will be back. <br>Big shout out to Lauren too!",
