"rating":"4.0",
"reviewcomment":"So this was my third time at Donovan&#39;s- my first time experience was amazing! I actually thought Donovan&#39;s beat my all time fav filet mignon from Ruth Chris..<br><br>Second time was for CE dinner.. N that&#39;s when the steak taste went down hill =\. <br>At third time.. Was so disappointed.. I ordered the same thing as the first time, but my filet mignon was not tender and not flavorful as first time.. :( so disappointed.. Also my potato wasnt not too cheesy.. n bacon wrapped scallop was aight- still delicious- Maybe becuz I came with high expectation.. Lol this happens to me every time errrrrr...=\<br><br>Also, the scalloped potatoes. Man I remember the first time I had it.. It was a...m...a...zing! It was so creamy, cheesy.. Mmmmm mmmmph mmmmph! But at my third visit here.. Errrr it was bad..=\ <br><br>I guess many people bought the u pay $40 for $80 deal- the three couples around us all had that deal.. Lol - and for Wednesday, the restaurant was pretty darn packed for fancy pancy restaurant!<br><br>I will still give this restaurant 5 star despite ok experiences from my 2nd n 3rd time.. Becuz my first experience was so yummy- I still remember how my filet, scallops, potato n mushroom tasted.. Lol<br><br>I&#39;m planning to come back here next month, so hopefully the chefs will be graceful with putting more cheese in my potato scallop and cooking my steak n scallops like the first time.. :)~",
