"rating":"4.5",
"reviewcomment":"I found love at first site as soon as I walked into Project Pie. With no line and a staff service focused on making your pizza the way you want it, I was quickly enjoying my oven roasted pizza with a smile on my face. <br><br>You can make your own pizza from scratch, or you can choose a pizza template suggested and add/subtract from there. If you go with a friend, it might be a good idea to split a sweet and savory pizza together. After a while of eating the sweet pizza with berry and nutella, I was getting a bit tired of chewing a lot more dough than fruit. <br><br>If you are like me and usually get water at restaurants because you are being economically conservative, I suggest purchasing a drink this one time, as their unique soda is worth the taste and the calories!<br><br>The place was hip, cool, and had a great vibe. The prices are friendly, and nothing beats eating a pizza next to a wall of inspiring and motivating quotes.",
