"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/FDZVIZm--kU4HN89qCNoJA/l.jpg",
"rating":"4.0",
"reviewcomment":"Going here tonight with a group of friends! Love this place. It&#39;s by far one of my favorite sushi joints. Their tuna tar tar is the best and the atmosphere is nice. They moved to a much bigger and better location than where they were before. I&#39;m guessing that because of this the prices went up a little, but it is still worth it. They are kid friendly as well and always give the kids little trinkets, pencils, or lights for their fingers. The presentation is always appealing and pretty. I&#39;m trying to think of a bad dish that I had there and I can&#39;t! I recommend this place to everyone and really enjoy it. The decor is nice. They have spoon sculptures and a samurai that looks like Darth Vader. They do play loud music so if you&#39;re not into that, be prepared. <br>One downside is if you have a large party they will split checks but only two people can pay with a CC, everyone else has to pay cash, and they add 18% gratuity when there are 6 or more rather than the normal 8 or more.<br><br>Other than that, this place is awesome and I highly recommend it!",
