"rating":"4.0",
"reviewcomment":"Vallarta&#39;s, i swear, owns the holy grail...which comes in the form of christian fries and carne asada fries...it&#39;s sought after by everyone.  Seriously, I come here AT LEAST once a week and gym so hard in order to make sure I can eat without becoming extremely fluffy.  Sober or not, I love Vallarta&#39;s, and Vallarta&#39;s loves me.  I even befriended the employees here because I come so often.  Taken to go, these fries are still bomb because the cheese becomes melted.  Eaten there, still bombdotcom because the fries are still amazingly hot and crispy.  If you dare to go big and the get christian fries, prepare yourself for crispy fried chunks of bacon and eggs.  How can you not love their fries--it&#39;s smothered in thick, fresh guacamole sauce, heavy sour cream, topped with grilled carne asada, and a fat layer of cheese?  If heaven promised me these fries for eternity, I&#39;d give up my life of debauchery and be on the best behavior possible... ( :0<br><br>Tip: order grilled onions (technically deep fried, but oh wells--go big or go home) they&#39;re complimentary.  <br><br>Hehe, sorry for the long message.  My passion is genuinely real.",
