"reviewcomment":"Outstanding on all levels. <br>Great ambiance and decor - well appointed, very quaint, wall art, sculptures, lighting, chandeliers, music - all create very nice and relaxing atmosphere.<br>Food was excellent. Everything tasted perfectly fresh. We had satay skewers, fresh spring rolls (peanut sauce was to die for), pot stickers and papaya salad as appetizers - all perfect except the papaya salad which was a bit too bland. The entrees were one better than the other. Salmon Panang Curry - delicious, garlic and pepper crusted chicken - again delicious, Gai Qua - again delicious, and pan seared sea scallops (very good, may be a tiny touch overdone, but not bad by all means).<br><br>restaurant offers nice selection of cocktails, wine and beer, all reasonably priced. <br><br>Service was very good, prompt and attentive. <br><br>Highly recommended.",
