"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/m846M9ZopharewiDZJv6ow/l.jpg",
"rating":"4.0",
"reviewcomment":"I&#39;m gonna wait till&#39; the stars come out, and see them twinkle in your eyes.<br><br>Never give this place much thought until the freaks come out.<br><br>Stopped by and went Japa-crazy. <br><br>Ichi - Grilled Baby Octopus. Tender and lightly battered, it was a stellar incarnation of calamari. <br><br>Ni - Lobster Dynamite Roll. Fresh, and popping with spicy mayo and eel sauce.<br><br>San - Hakata Ramen Bowl. Thin sliced pork, dehydrated mushrooms, scallions, and noodles in a miso ginger broth. Delicate comfort food.<br><br>Saisyuu Hakai - Black Sesame Ice Cream and Cinnamon Apple Spring Roll. Velvety Ice Cream and Warm Crisp Sweet Roll - awesome flavor and texture contrasts. A really unique treat.<br><br>The food was perfect and I was transported by my senses to far away lands...the epitome of a 5 star experience.",
