"rating":"3.0",
"reviewcomment":"Great spot for people watching if your sitting outside, sipping on your drink. The Living Room has a good selection of tasty teas. <br><br>My first trip here and I was able to sit outside in the seating area in front of the cafe. The front of the cafe is right at a busy intersection so it is great to sit and watch the cars rolling by and the people strolling by.<br><br>I was able to enjoy their pastrami sandwich which was fair. It came with a small bag of chips and a pickle. Nothing outstanding. However, over all my experience was enjoyable. The seating area inside was largely available for groups of three or more. Since I was in a party of two, we were limited to our choice of seating.<br><br>The bathroom is a co-ed restroom. It could use a little help in the cleanliness area, however we were there on an busy Saturday and it is entirely possible that the staff was busy. <br><br>I really enjoyed the tea that I had here. It was a flavorful. I would go back for the tea dn the people watching.",
