"rating":"4.0",
"reviewcomment":"Great dinner experience and favorite steakhouse in San Diego thus far! (Donovan&#39;s doesn&#39;t hold a candle to Flemings.)<br><br>Came during this past Memorial day weekend for the $30 prime rib special (3 courses; app, main, desert) which was as available during the three day weekend instead of when prime rib is served just on Sundays. I had a caesar salad and my boyfriend ordered lobster bisque, which he enjoyed greatly. <br>Our large prime ribs came perfectly medium rare, with three sauces (typical au jus and horseradish, but a third mustard one which wasn&#39;t my favorite). Super juicy and tender, one of the best cuts I&#39;ve had to date. <br>We ordered sides of garlic mashed potatoes and asparagus which were delicious, but when they say one side is enough for two they are not joking around.<br>Ordered cheesecake and creme brulee for dessert, the former being better than the latter. Cheesecake was not overly dense or sweet and completely satisfying, while the creme brulee had good custard but something tasted off on the torched sugar top.<br><br>Would highly recommend; though pricier, the service and food was pretty impeccable. Boyfriend also enjoys going for their great happy hour, $6 cocktails and food options.<br>Validation for parking at the Hyatt garage is available, but darn that downgrade hill you need to hike up and down if in heels!",
