"reviewcomment":"This review is strictly for their happy hour: 3-6pm daily, 1/2 of tapas, $9 drinks/cocktails.  I would call first on holidays to make sure they&#39;re still doing happy hour that day.<br><br>Anywho, must eats are the duck quesadilla and crab stack!  We always get the hot rock too, there&#39;s just something about cooking that raw meat on a rock.<br><br>Drinks are also pretty good, they definitely don&#39;t skimp on the liquor.  The 2am martini is a tasty dessert.<br><br>Bottom line: yummy interesting food, good drinks, go for happy hour.  Bewarned, tapas come for 4 and if you&#39;re a group of 4, you will probably need to order at least 5-6 tapas for it to feel like enough for dinner.  Don&#39;t say I didn&#39;t warn you about the small portions.  We usually spend about $25-30/person including drinks &amp; tip.  Like I said, happy hour is your best friend.",
