"ogurl":"http://www.yelp.com/biz/brazen-bbq-smokehouse-and-bar-san-diego",
"categorystrlist":"Barbeque,         Bars,         Breakfast & Brunch",
"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/YW8fcn-ULbKl5fPgpF85WA/l.jpg",
"rating":"3.5",
"reviewcomment":"My fiancee and I have eaten here three or four times now and haven&#39;t been disappointed. The venue itself is decorated quite well. You walk in, smell the smokey, meaty flavor and immediately get the feeling that you&#39;re going to enjoy some delicious BBQ.<br><br>We&#39;ve always sat at the bar and been taken care of by Gray. Dude is on point. He anticipates your needs and sees things that other waiters don&#39;t. The  guy knows the food, the drinks, and what to order.<br><br>Let&#39;s get down to the discussion at hand, the BBQ. It&#39;s solid. We usually get the sampler platter of a few different meats and sides. This last time it was brisket, chicken and shredded pork. All three were great. The chicken had a perfectly flavored crispy skin while being super moist and flavorful on the inside. The brisket was a bit light on flavor, but we managed to put some of the house smokey BBQ sauce on top and it was awesome. I don&#39;t know what to say about pulled pork. I love me some pulled pork and this did not disappoint. Flavorful, moist and a few crispy ends on it to give it some texture.<br><br>We chose the small salad and fries for our sides. Our fries were perfectly cooked and seasoned with a BBQ-y/smokey salt of some sort. They were delicious. The small side salad was just enough to finish off the meal.<br><br>They have a pretty solid selection of San Diego beers with a few out of town choices as well. <br><br>Anytime we&#39;re in Hillcrest and want a solid place for lunch, it&#39;s hard to turn down Brazen.",
