"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/yOnUXKW6t4lWJGCl052SwQ/l.jpg",
"rating":"3.5",
"reviewcomment":"HOW I LOVE CRAB CATCHER OMG!<br>I am from Arizona so...seeing fresh seafood is justttt a dream. anywho!<br>I was on a road trip with my 2 girl friends and we made a very careful plans about where to go. <br>Crab Catcher was our dinner the first night. La Jolla is a beautiful area and the location of the restaurant is just perfect. We came in during Happy Hours and got at least 10 oyster shooters ( excuse us AZ girls just loveeee oyters), some martinis at the bar and then we moved to the table on the patio that directly faces the beach. the sunset was gorgeous. BUT this is the best part: FOOD!<br><br>My 2 girlfriends one got grilled salmon and the other one ordered grilled sea bass. I, on the other hand, don&#39;t like any type of grilled fish (I know, I&#39;m crazy), ordered CITRUS &amp; GARLIC BAJA TIGER SHRIMP, and let me tell you, one of the best dishes I&#39;ve had in my life. Just something about the citrus and garlic combined with grilled tiger shrimp create perfection. <br><br>Though my friends also said that their grilled fish were phenomenal too. And we&#39;re planning to make a trip to SD sometime this summer, and when we do. Crab Catcher is on our list again.<br><br>After I went back to AZ, I&#39;ve been trying the similar dish at any seafood restaurant I go to and none of them comes even close. <br><br>If you&#39;re a shrimp fan like me and have a chance to come to this place, you have to try it.",
