"categorystrlist":"Breakfast & Brunch,         American (New),         American (Traditional)",
"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/dbAuHYaYtcT1QvgVHncQig/l.jpg",
"rating":"4.0",
"reviewcomment":"Heard about The Patio a few months ago, after moving from San Francisco. Was super exited that Pb finally had a place with craft and classic cocktails! <br><br>Went in yesterday, with my sister, both of us coming from cocktail bars in SF, we loved it! I&#39;m so happy we have this as an option, rather than just another beach bar in PB. <br><br>They have an awesome cocktail list, spirit list, and amazing food. We tried the beet arugula bruschetta. It was delicious. I had several cocktails off their &#39;Cool Cocktails&#39; list: all of them very tasty. My favorite was &#39;The Paper Airplane&#39; with rye, Aperol, and sweet vermouth. Simple, but sooo good! <br>Our server, Andy, was also very attentive and sweet. All of the staff was pretty helpful, and also very attentive. I don&#39;t think I ever had an empty water glass in front of me.<br><br>The atmosphere is very chill, and they have a beautiful patio with greenery you can sit at. Beautiful and awesome decor. <br><br>Thanks guys for bringing The Patio to PB, you guys are definitely doing something right over there. You&#39;ll be seeing me again soon!",
