"rating":"3.5",
"reviewcomment":"Decent sushi for a great price.  I will disclaim that I come here so often that a group of friends and I have a regular table, as well as know most of the staff.  So it&#39;s odd when I say until last week, I never had the Sexy Roll before.  But it&#39;s the most popular on the menu and is delicious!  My most regular food order is a bento box and a roll, but the best part of RK is the drink special!  $5.25 for a large Sapporo and saki!  <br>Though I love this place a lot, it&#39;s only 4 stars because the sushi  is only a bit above average, and I wish they had a larger selection of special rolls.  My comparison is to size of the menu at The Joint in OB.  <br>Also note, be prepared for a long wait on Friday nights.  Never been here any other day of the week but on Friday, it will be over an hour.",
