"reviewcomment":"Mo&#39;s has something for everyone, that&#39;s what I love about it. They are a gay establishment and truly give so much back to the LGBT community. 2nd reason I support Mo&#39;s, after the food. <br><br>They have good food--everything from burgers &amp; steak fries to low calorie chicken sandwiches to generous salads. I was pleasantly surprised when I ordered the salmon special!  Well prepared, tasty and a generous serving. <br><br>This place has deadly strong drinks! Not for the weak, that&#39;s for sure.  You think you&#39;re a hardcore drinker?? Try the fishbowl! $17 and you get the strongest AMF served in a fishbowl, includes a toy pet fish. <br><br>Sunday brunch is usually a very American style breakfast buffet. Pancakes, waffles, omelettes, etc. Note that the price &amp; wrist band includes bottomless mimosas!",
