"rating":"4.0",
"reviewcomment":"Pork larb, spicy noodle, pad thai, mango sticky rice and thai ice tea - the regular dishes that comprises our dinner when we dine at Bangkok. The friendly, fast, efficient staff also makes for a great dining experience.<br><br>Pork larb is sooooo flavorful and spicy and is great in contrast with the lettuce wraps and cucumbers they give you to eat with. I love their Thai ice tea - not to sweet, even though it&#39;s a little heavy on the condensed milk for me. Spicy noodle is spicy and is loaded with your choice of meats. As for the mango sticky rice....I could come here and eat just that. The rice is the perfect blend of warm and sweetness and the mango is soft and juicy. Obviously the mangos taste better when the fruit is in season, so...grain of salt! <br><br>Generally speaking, portions are very generous and they don&#39;t skimp on quality. I&#39;ve come back here several times, and will continue to dine here. Great service, great food, and great prices.",
