"rating":"3.5",
"reviewcomment":"I have actually eaten here on occasion, whenever there&#39;s time or whenever there&#39;s a birthday among my friends. I really enjoy their crepes, Belgian waffles, but especially their gelato.<br><br>Whenever I go here, I always order my usual white chocolate Belgian waffle with black sesame gelato. At first it seems like an odd combination, but it&#39;s really good and delicious! It doesn&#39;t hurt to try something new, right? Pricewise, Cafe Hue is okay. Most people would say it&#39;s cheap, but I say that it&#39;s just so-so because you can technically make all of their desserts yourself (except certain gelatos, unless you&#39;re a chef of some sort).<br><br>Overall, I think I wouldn&#39;t get sick of it, since that&#39;s the only good place with great tasting gelato. I wish there was more seating available as well, but I guess they have what they can work with.",
