"rating":"4.5",
"reviewcomment":"Absolutely the BEST Thai food in San Diego. The dishes are extremely fresh, flavorful, and spiced just the way you want (we have one &#34;zero&#34; and one &#34;3-4 medium&#34; in our house - and each time it&#39;s perfect).<br><br>The menu is a little limited - and that&#39;s actually a good thing imho - they don&#39;t try to have &#34;everything&#34; but focus on doing a smaller number of dishes to perfection. The monthly specials keep things interesting. We eat there at least once if not twice a week and it&#39;s always wonderful. Pad Ped (beef) is so tender and flavorful, Bai Grapow (chicken) has a perfect kick to it. The spring rolls are so crispy and fresh - without any kind of &#34;heavy&#34; or &#34;greasy&#34; feel. I could go on, but now I&#39;m too hungry to type :) <br><br>The seating is definitely limited - but not an issue for us as take-away customers. <br><br>The owners and their staff are not only great restaurateurs, but great friendly neighbors - we are so happy to see the success that they are having!",
