"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/-eGAUrMrox3Fv2ouWgcGOg/l.jpg",
"rating":"4.0",
"reviewcomment":"Came her one night for restaurant week with my boyfriend. This place has the cutest decor, vintage and whimsical lighting with cool designs on the wall (mini painted bookshelf! So cute) <br><br>Our waiter was really helpful in suggesting what to order once we heard our likes and dislikes in certain foods. We ordered a wine flight, great selection! I ended up getting the lamb which was delicious! I like lamb but normally don&#39;t order it myself, but I&#39;m glad I did. We also had the Vietnamese meatballs, stew, and my favorite part dessert: bread pudding and the Brooklyn girl brownie. Both delicious! The brownies super chocolatey for all you chocolate lovers. <br><br>I docked a star however because the seats are way too close and you could hear other people&#39;s conversations or people were always bumping into each other&#39;s tables which is kind of bothersome. I&#39;m all about the entire eating experience so the proximity of other groups was definitely a downer.",
