"categorystrlist":"Korean",
"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/XhLimc5dqGkBz8XmDUAj6w/l.jpg",
"rating":"3.5",
"reviewcomment":"Mixed soft tofu stew is the way to go!<br><br>Hands down the best soondubu in San Diego in my opinion. I&#39;ve tried soondubu at least in 5 different restaurants but none is better than convoy tofu house. I also love their banchan that they served. My favorites are definitely the picked cucumbers and potatoes. For less than $10, you get endless banchan, soondubu of your choice, egg and steamed rice. They also serve my favorite barely tea (cold) free of charge. The other items here are a bit pricey but I mainly come here for their soft tofu. <br><br>Highly recommend:<br>- Mixed soft tofu stew that contains beef, clams, shrimp and mushrooms<br><br>You have the option of choosing how spicy you want it. Just letting you, their spice level are not too spicy. I usually can barely handle mild at other restaurants here but I get the regular/medium spice level here and its perfect for me. When you get your soondubu, you might think &#34;oh this is not going to fill me up&#34; but trust me, it will with all the endless banchan and steamed rice! <br><br>Service is great. All the servers are sweet and very proper!",
