"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/XqJSTnLTfuZCI19WB4rDBw/l.jpg",
"rating":"4.0",
"reviewcomment":"I was invited to a wedding reception at the Marine Room, and it was a splendid view. It really is. <br>I asked myself if I would host my reception here, and in the privacy of my own mind, I said no. <br>I didn&#39;t like the room lay out, much. The bride had 130 in attendance and their was a 1/2 wall dividing the better half of the room, we couldn&#39;t really see anything ie- the speeches or the first dances. The crowd thickened around the spotlight dancers and their wasn&#39;t an easy way to see. I want to be the center attention on my day and not have my guests standing on chairs to see me.  - we couldn&#39;t hear for that matter, either. maybe it was the speakers I don&#39;t know. I wasn&#39;t impressed.<br><br>The servers were incredibly kind and polite. I enjoyed a lobster bisque and seafood crepes. . The bisque wasn&#39;t as pleasing as previous reviews quoted. The chef went too heavy on the nutmeg (maybe)? <br>I only knocked down one star as the room was not fitted for a large crowd, in my opinion. Make sure you see the big pic before you book, if you&#39;re thinking of celebrating here.",
