"reviewcomment":"O.M.F.G.<br><br>I was in town on business, and my friend was trying to get us into Sushi Ota for a same day reservation, but they only had 5:30 and 9:30 available.  He knew that Yoshi was originally a chef at Sushi Ota, so we were able to get seats at the bar at 7:30pm no problem.<br><br>I can&#39;t explain how happy I am that we got this reservation.  This was easily one of the absolute best sushi experiences of my life.  I&#39;ve had sushi all over the US from business travel, have been to Nobu, Morimoto, and more places in between than I can remember, but this is one that will never be forgotten.  <br><br>Yoshi was our chef for the evening (we had seats right in front of him).  We started off with the jalapeno yellowtail, and from there, we just told Yoshi to make us whatever he wanted and we&#39;d eat it.   We had amberjack (a little salty), octopus carpaccio (never had it raw before and it was great), another jalapeno/cilantro topped roll with a spicy green sauce, another roll that was topped with diced jalapeno (I put some pictures up).  Another that was crab/avocado surrounded by tuna and salmon, with big ball of avocado wrapped tuna and salmon in the center (Yoshi Special?  Many pics up here of it, including mine).   Everything was great, and that&#39;s putting it mildly.  I wish I knew the names of everything we had, but we just ate what he gave us.<br><br>We had ordered a full bottle of Geikkeikan sake, and were drinking it with Yoshi, when we asked him for something crazy off the menu.  We simply specified no mackerel or uni.  So, out he comes with two live shrimp, takes the tail out and prepares is as sashimi, and decoratively puts the still kicking heads on our plates.  After eating the tail, they take the head to the back and flash fry it, and bring it back to be eaten in some sauce, eyeballs, guts, and all.   Cross that one off the bucket list.<br><br>Usually at most sushi places, I get a miso, but we never bothered with that here.  The wasabi was barely touched.  Yoshi was telling us to not use soy sauce with what he was serving us, and he was not wrong.  Only one thing we got did he say to use it, and that was the one time the soy sauce and wasabi got touched.<br><br>Fantastic meal, chef, and ambiance.   Like Shiro in Novi, MI, this is a place I would always come back to.",
