"reviewcomment":"Wow, what a spacious place! <br><br>After walking around the North Park Festival of Arts in the blinding sun for way too long, I needed an icy coffee drink STAT. When I walked in I felt like I&#39;d walked into an old historic building and all the space inside made me want to twirl around and around until I got dizzy and fell down. But I didn&#39;t. Because I&#39;m a mature adult, you guys.<br><br>I gazed up at their enormous menu and settled on the Funky Monkey (or something like that), which was a blended mocha with a banana. Yes please. I just grabbed my drink and left, but it definitely hit the spot and I drank that sucker down in like five minutes flat. Ugh. The sun is so gross. Anyway, I&#39;d come in again for a cup of coffee or a pastry.<br><br>BTW, a small size blended drink = 16oz.",
