"categorystrlist":"French,         American (New)",
"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/pkBghJRBj139ebuzueAu1A/l.jpg",
"rating":"4.0",
"reviewcomment":"So I was preparing my yelp review in my head as I sat in the restaurant - and it seemed a solid 4 stars. Cute decor, attentive waitstaff, varied menu and drink options. I was a bummed about the pricing - drinks a couple bucks more than I&#39;d have preferred, and entrees for close to 30 - so my group decided to do a bunch of appetizers and treat it like tapas. <br><br>What a surprise when the apps came out and they were all huge! One of those could definitely make up your main course, and bumps them up to five stars. I can only imagine how big the entrees are! We got the duck (delish), shortrib agnolotti (solid), burrata and tomato salad (so excellent), scallops (melt-in-your-mouth) and baked brie (decadent). Was full and happy by the end of the meal, so I&#39;ll have to come back to hit up the chocolate bread pudding.",
