"reviewcomment":"I am not a vegetarian at all, but I loved this place! A light filled room with high ceilings and a warm, friendly and professional staff greeted us for dinner. We were able to be seated by the window and our order was taken quickly and our food arrived within 15 minutes! Buddha burger- amazing! The salad was a wonderful medley of shredded beets, carrots, cucumbers and fresh greens and the lemon tahini was to die for! The pea curry was a delicious and filling entree, and it also comes with a choice of soup or house salad. <br><br>The prana tea was awesome and invigorating, and you get on free refill on drinks! Lastly the chocolate mousse cake -- woo!! so rich and melting in your mouth. Good to share for two. <br><br>I had a coupon from pilgrimage of the heart yoga studio, and the staff even gave us an extra 10 percent off for being part of the local wellness collective! All in all, I was very impressed and I will happily go back! Bravo :)",
