"ogurl":"http://www.yelp.com/biz/melting-pot-san-diego",
"categorystrlist":"Fondue",
"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/QLtq0mDL8bARmfHESqQNqQ/l.jpg",
"rating":"4.0",
"reviewcomment":"I took my sister here for her birthday.  I took her to a lot of places during her birthday week, but she wanted to try something new for the exact day of her birthday.  So I went online, joined Club Fondue, and I called in ahead for the birthday package.  Someone told me this place was for special occasions, and it was!  She came to her table with beautifully handwritten letter made out to her from the Melting Pot, with balloons, streamers, and the whole package.  They even had a rose prepared for her as she came in!  <br><br>The service was great from the moment we entered, and we tried the four course meal.  We had to eat slowly so we could eat everything, but we slowly had the new garlic and Herb Quartet Cheese Fondue.  I have to recommended this item on their &#34;Fondue Features&#34; menu.  Then we had our Fouse Salad and Caprese Salad, both which were welcomed after having as much cheese fondue as we could.  We needed to take it slow, or we would be stuffed before the 3rd course!  We then chose our entrees, the Land and Sea and The Classic cooked in the Caq Au Vin, which was perfect for our main entree.  I loved how they gave us the &#34;search and rescue&#34; spoon, which definitely came in handy!  Everything tasted great with the Presecco bubbly we had throughout the night.<br><br>We then had the Dark Chocolate Marscarpone, which tasted great with everything!  As we started our dessert, they came with chocolate covered strawberries and a candle on the plate, which my sister shared with me.  They are to good enough to die for!  Since I was a Club Fondue member, they also gave her a package of 6 chocolate covered strawberries to take home, which made the night even better.  As we walked back to the hotel, everyone wished her happy birthday thanks to the beautiful balloon arrangement they made, and it was surely a night she wouldn&#39;t forget.  To top it off, they gave her us a military discount since she was heading to see her husband who was stationed overseas.  He couldn&#39;t be there, but The Melting Pot and I made sure she had a great night.  <br><br>If you&#39;re looking for a place to go for a special occasion, look no further.  All around us during the night, we heard servers say &#34;Happy Birthday&#34; or &#34;Happy Anniversary&#34; so we knew that we were not alone in celebrating her big day.  I will definitely come back here again, and try their 5 for $5 happy hour deal, which looks too good to pass!",
