"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/xoc9i63t5UfYQPrWZ_2GIA/l.jpg",
"rating":"4.0",
"reviewcomment":"10pm on a Monday night, of course my boyfriend and I were craving some delicious pizza...  After a quick search on Yelp, Landini&#39;s seemed to be the obvious choice for us as we were staying less than 5 mins driving distance away (perfect for delivery).  <br><br>We hopped onto the website and quickly customized the perfect pizza:  Sundried tomatoes, sausage, pesto, green peppers and Jalapeños.  We placed the order and within 2 minutes had received a call from Landini&#39;s....unfortunately it wasn&#39;t the call we had hoped for.  <br><br>Apparently the delivery driver had went home early sick and they weren&#39;t doing any more deliveries for the night.  Considering we had already went through the effort of building our pizza and that the place was such a short drive away, we decided to go pick it up instead.<br><br>When we arrived, the employees were extremely apologetic and friendly, our pizza was ready-to-go and staying hot and fresh on top of their oven.  They even waited to put the pesto on right in front of our eyes!  To top it all off they gave us a discount for the small inconvenience of having to drive over, we didn&#39;t even have to ask!<br><br>The pizza was delicious and we were wholly satisfied with our decision to drive over and pick up our pizza!<br><br>Thanks Landini&#39;s!!",
