"rating":"3.5",
"reviewcomment":"Now I&#39;m no aficionado when it comes to Vietnamese cuisine, <br>but I know what I like, and this place provides all of that. <br>Food is great. Service is fast &amp; friendly. Prices are reasonable. <br>I come here often, as I live only a few miles away, <br>and have never been disappointed with my experience. <br>I have dined in, and also done phone-order/pick-up. <br>I&#39;ve been here with friends &amp; family, and sometimes solo for lunch, <br>always with a good experience. <br>Restaurant is large, nice, and clean, with plenty of seating, and that&#39;s good, <br>because a great reputation causes this place to get busy during the rush hours (lunch &amp; dinner), but there is still almost never any waiting. <br>I have tried several different versions of pho, and other soups, <br>as well as many other dishes and appetizers, <br>and not been disappointed in the great quality and flavors. <br>If you like Vietnamese food, or have never partaken and want to try something tasty &amp; different, I highly recommend you try this place.",
