"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/Vu3HbZ70wfwIKXvWKTkoPQ/l.jpg",
"rating":"4.0",
"reviewcomment":"This is by far my roommate and my favorite place in Little Italy. We live right down the street and love that we can easily walk here. The service is great and the food is even better. My roommate and I both eat gluten-free and for only $2 more, we can get our pasta dishes gluten-free (they only have a gluten-free penne). The restaurant is decorated like a little Italian village (hence the name). Our friends say that the bread and olive oil they give you at the dinner table is absolutely amazing. Mimmo&#39;s is our go-to place when we have friends and family visiting because we know that we will always get a delicious dish. My roommate&#39;s boyfriend thinks that his mother makes the best Chicken Piccatta but after eating at Mimmo&#39;s, he says that Mimmo&#39;s is pretty darn comparable! My roommate and I love the Penne al Pesto (gluten-free, of course) and often pick up to-go orders of it.<br><br>I highly recommend this place!",
