"reviewcomment":"My girlfriend took me here for his birthday and we sat on the outside patio. The view was amazing but it did get kind of windy and need the heaters on. <br><br>We started off with the Jumbo Lump Crab Cake and the Fiji Apple Salad, split the Filet Mignon, and got a side of Truffled Macaroni and Cheese and Brussels Sprouts. The food was great but what really blew me away was the amazing service we had. Right when I sat down they handed me a birthday card and all the busboys and expo&#39;s that helped us throughout the night  all said happy birthday to me at least once. Danielle was our server and she did an amazing job and really did make me feel special on my birthday. I highly recommend this restaurant for any special occasion or just a beautiful night out.",
