"reviewcomment":"I don&#39;t usually like to give my little hidden neighborhood gems away but I  this place so much, mainly due to the owner, that I thought it important to give some kudos where needed. <br><br>It can be pricey but that&#39;s why it&#39;s best to come during happy hour. The portions are a good size and it&#39;s a very intimate, QUICK place to dine at before seeing a nearby movie.<br><br>The best thing is the customer service - we came recently prior to a film and the owner is just fantastic. He&#39;s funny and very customer-service oriented. He seated us by the best seat in the house - by the window.  And, he also helped me supplement with non-soy based meals due to soy sensitivities. My favorite is the chicken and plum sauce and my bf loved the potatoes. When trying to figure out where to go on a Saturday, definitely go local and go here!",
