"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/Lwpio-klPEod7v4v-sc3Cw/l.jpg",
"rating":"4.0",
"reviewcomment":"Farm to table galoreeee! Succcch a cute place! I went here for Happy Hour on a Monday night RIGHT after work. The only crappy part is that happy hour ends at six. It was literally ONE happy hour because I get off at 5. LOL. <br><br>Buttt, I ordered the flat bread (which changes in toppings on a daily basis), and the fish tacos. Both were amazzzzzing! Full of flavor and even better knowing that it comes fresh from their very own little farm! Both were pretty good prices. And I also got a $5 glass of chardonnay. <br><br>THE best part? The desssserrt! We ordered the mini banana cream pie and let me tell ya, it&#39;s not mini. It&#39;s a good portion of dessert. It was sooo good, and mind you, I&#39;m not big on bananas or majorly sweet desserts. This dessert was PERFECT!<br><br>The service was awesome. The staff was super friendly. You guys get five stars! Wink ;).",
