"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/DpO63xCcsYwWNz4O3cFwyQ/l.jpg",
"rating":"4.5",
"reviewcomment":"We just drove into San Diego and put our bags away and were really hungry. Italian was on our mind and Enoteca Andriana was only a few blocks away. We weren&#39;t dressed that good but saw on Yelp that it was casual. Not a problem, we were welcomed warmly. <br><br>They bring out bread that is stuffed with fresh melted mozzarella with a dipping sauce. Oh my goodness. So good. They also brought out water glasses with thinly sliced cucumber. Very different. Gives the water a nice taste. <br><br>We started out with Minestone soup. Fresh vegetables and pasta. What can I say but really good. I had the orecchiette Bosco with minced fresh sausage and a really good red sauce.  Excellent. Very tasty. My wife had the spaghetti con Polpette with two huge meatballs and fresh mozzarella. The meatballs were melt in your mouth goodness. Very good dish. <br><br>The service was really good. Water cups were filled promptly and our food came in a timely manner. I would have to say that was probably one of the bet Italian meals I&#39;ve had. <br><br>Only problem with this place is that there is no parking. Only street parking, but free. <br><br>Good food and good service. Enjoy and indulge.",
