"rating":"4.0",
"reviewcomment":"As good as it gets as far as the San Diego wine scene goes.  Seriously.  You can&#39;t do better than this wine selection at these prices.  It is fun, unusual, exciting, and diverse.  The price for the wines, both by the glass and by the bottle, are almost shocking!  I think there&#39;s a small corkage fee for bottles purchased and consumed on premises.<br><br>The food is also quite nice.  The melted Humboldt Fog with mushrooms is always a good go-to for a snack or appetizer.  My beet salad was delicious, as were the various other dinner entrees at the table (steak, mussels, etc.). <br><br>I really like the ambience and service as well.  The wine folks are knowledgeable and the servers are friendly and no-nonsense.  The place is cozy, more like a house than a restaurant.  There is a nice patio too. <br><br>Every time I visit San Diego, I make it a point to come to 3rd Corner.  You should too.",
