"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/IFSOxRH6oO4sxmKSTNoYbA/l.jpg",
"rating":"4.0",
"reviewcomment":"Nice mini-like shops and street performers with a SF Fisherman&#39;s Wharf kind of feel. Their military-themed windmills and outdoor decor shop are my favorites. I would have to return to the village to buy a U.S. Navy windmill. Check out their souvenir shops especially the small giftshop with the cool military patches and flags.<br><br>I haven&#39;t dined in their eateries but I always come to this tourist location just to eat Ben and Jerry&#39;s ice cream after taking a long walk around their marina walkfront towards the SD Convention Center. <br><br>There&#39;s a limited metered parking lot further down from this village. It is nice to park near the USS Midway Museum and take pictures of the Unconditional Surrender &#34;Sailor&#39;s Kiss&#34; statue. <br><br>I think it is better to park outside of the Seaport Village parking zone. It allows you to enjoy the scenary more than the shops and entertainment. You should also consider stopping by this village during ComicCon. It is interesting to watch cosplayers dine here with their cool outfits and weapons. ^_^",
