"categorystrlist":"American (New),         Vegetarian,         Wine Bars",
"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/BAItv28tzaucgGRF4jdwig/l.jpg",
"rating":"4.0",
"reviewcomment":"I enjoyed my experience both times I&#39;ve dined here (for dinner). It was refreshing to have so many low-calorie options to choose from, and it was obvious that all of the incredients were fresh and healthy.  It takes a lot of imagination, talent, and skill to bring out the wonderful taste of food without adding fat-based sauces, and they&#39;ve got what it takes. Plus, the variety of choices on the menu is impressive.<br><br>If you are looking for really large portions, lots of fat and calories. this restaurant probably is not your best choice.  If, on the other hand, one or more members of party would appreciate being served a healthy, seasonally fresh, delicious meal, this place fits the bill.  <br><br>The service was great!<br><br>Attire is casual or dressy; I&#39;d feel comfortable either way. Definitely not formal.<br><br>As another reviewer pointed out, it&#39;s probably not the place for most kids, but it depends on the kid.  My parents took me to all kinds of restaurants, and I was fine with it as long as they served American dishes, but maybe that was because I was the quiet bookworm type.<br><br>I&#39;ve already started recommending this restaurant to my friends.  Very enjoyable, and the prices are neither higher nor lower than what I&#39;d expect to pay at a place like this.",
