"rating":"3.5",
"reviewcomment":"To be honest I have a love not just ok experiences at BJ&#39;s .<br>My sister was moving to Missouri, aka misery.   I know who leaves paradise right?  We are natives and we always end up migrating back.<br>Anyways  I asked them to pick 3 places they wanted to go to, and then since I have celiacs I&#39;d pick from those places.  My husbanded was hoping for Mexican but my mom who gets killer heartburn vetoed all Mexican options.<br>9 of us were sat quickly at 7pm.  Server was really sweet, sadly I don&#39;t remember her name.<br>My only real con it that they don&#39;t offer more gluten free options for appetizers!<br>Me and my sister decided to split the new Kale and Brussels sprouts salad and the thyme chicken!  Both blew me away at how good they were. <br>The thyme chicken did have A LOT of liquid in it, stock I guess, that Maude it messy and as if the kitchen was rushing to plate it. <br>But besides that it was really good.  We were both impressed at how good both dishes were. <br>Don&#39;t care for their gluten free pizza so I&#39;m glad they have newer and better options.  Ohh and their pizzookie is to die for!!! But I was full and didn&#39;t need the added 12000000 calories, ok it&#39;s only 1200 but still.",
