"reviewcomment":"SALT AND PEPPER CHICKEN... AMAZING!  <br><br>If you&#39;ve ever gone to a SD Filipino family party you know the staple Salt and Pepper Chicken wings and that they are best when they come from Royal Mandarin!<br><br>If you ever come here on the weekend late morning you&#39;ll see trays and trays and trays of these coming out!<br><br>Best if eaten fresh... but still maintains throughout the party.<br><br>DINE IN... <br>Eating here is even more so amazing with good size portions... fast service and great food.  Honestly, just eat here if you&#39;re in the neighborhood or take out to eat at home.  <br><br>Other notible mention:<br>Noodle Dishes<br>Fried Rice<br>Salt n Pepper Calamari<br>Upsidedown Noodles<br>War Won Ton Soup<br><br>If you eat here, you&#39;ll keep looking around to see what other people got and ask yourself why didn&#39;t I get that?  Everything they serve that walks by looks amazing!   <br><br>This review is probably a rambling mess, there&#39;s just too much good stuff I can&#39;t put them into words... final note... if you want good mouth watering Chinese food... can&#39;t miss with this place!",
