"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/7OGScYEKhtbjBQARvf8WjA/l.jpg",
"rating":"3.5",
"reviewcomment":"Although expensive, I like this place.  The Rolls are excellent (I&#39;m partial to the Volcano Roll), It&#39;s a nice looking restaurant and it has great ambiance for an East County restaurant.  If the weather permits, sit outside.  <br><br>I&#39;ve been happy with the service every single time.  The staff has been very alert and responsive.  Inside seating is tight and takes away from the intimate setting though.  If you felt so inclined you could simply reach over and try to take a taste of a neighboring patron&#39;s sushi roll with ease.  I haven&#39;t done this but I could.  I wouldn&#39;t really have to rely on my amazing ninja skills to pull it off either.  Again, sit outside.  You won&#39;t have be in tight quarters and you can talk without hearing your neighbors conversation (or them hearing yours).<br><br>Tip - this place can be really expensive.  Most of their rolls are gourmet sushi, priced anywhere from about 11 to 19 bucks.  Read through the menu though.  You will find many standard rolls like a shrimp tempura or a spicy tuna at a reasonable price (6 to 7 bucks).  If you want to check this place out without breaking the bank, check out the standard items hidden in each part of the menu.<br><br>I will keep going here.",
