"reviewcomment":"This place is AMAY-CRAY! (Yes! I did just make up this word...)<br><br>Ice-cream sandwiches! Simply the best idea on a hot day in PB. And such a great location right off the beach. How have I not known before!?<br><br>You have the choice of any two cookies (brownies, waffles...pancakes, cones - whatever lol) and ice-cream to make your own sandwich creation. I decided to indulge in chocolate chip cookie dough ice-cream sandwiched between the softest and most delicious of chocolate chip and oreo-cream cookies I&#39;ve ever tasted in my life! ($3.50)<br><br>It&#39;s great for many reasons. 1) It&#39;s FLIPPIN&#39; DELICOUS! 2) It&#39;s affordable &amp; 3) It&#39;s an extremely portable, carefree dessert for walking up and down the boardwalk and strips in PB.<br><br>It&#39;s both a good &amp; bad thing I don&#39;t live in PB. Good: I won&#39;t double in size over the weekend. Bad: Where am I going to get my ice-cream sandwich fix now?",
