"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/inqrzsaCuUkZN_hIMkFeNQ/l.jpg",
"rating":"4.0",
"reviewcomment":"SO GOOD! I came here for lunch last week and was not disappointed. We got the pitcher of sangria right when we sat down. It was so delicious, fruity, and refreshing. It was just what we needed on the hot day that we went. I ordered the burger which came with bacon, over-easy egg, and some special sauce on top. It was so yummy and the bun looked delicious too but I passed on it. I split the burger with my bf who got the caesar salad. I know he was a little disappointed in his meal but I think it might have been just because I opted for the delicious, unhealthy heart-attack on a plate. Needless to say, he got his fair share of burger and fries and we were both very full afterwards.<br><br>The service was great and our waitress was so attentive. She always made sure our sangria cups were full as well as our water glasses. The decor is really cute and the music was great. <br><br>I will definitely come here again, considering it was delish and it&#39;s right down the street from my house!",
