"rating":"3.5",
"reviewcomment":"I really enjoy this place. I live in La Jolla, but come down here to eat when I&#39;m in the area.<br><br>First off, their spring rolls are super-sized while priced the same as normal size spring rolls. I would say the two spring rolls you get are 3/4ths a meal! Also, they&#39;re just delicious - the meat to noodle to lettuce proportion is just right. Definite recommend. <br><br>Just by the smell of this place, you could tell that it authentic Vietnamese food, which is always a plus in my book.<br><br>I would describe customer to wait-staff interaction as being fed by your busy uncle. Our interactions were always distantly friendly. Although, I had to call them once or twice - they never seem to be bothered. Also, my water glass was never empty, which I can&#39;t say about most of the Vietnamese restaurants I know. <br><br>Highly recommended.",
