"rating":"4.0",
"reviewcomment":"In a Napoleon Dynamite voice, &#34;they have some wicked sweet tots.&#34;<br><br>If you plan on trying to get here on a game day or during a big sporting event, get here early. It will be more then likely packed. They have lots of TVs throughout the restaurant and bar that always have sports events on. They have a pretty decent selection of beers on draft and have a nice happy hour 7pm to 10pm daily. They have a basketball hoop that you shoot hoops when it isn&#39;t crazy busy as well as a 4 person Pacman and other fun games.<br><br>The food is a little on the high side, $10.5 for a basic hamburger, but they are pretty big and come with your choice of fries, tots or a side salad. What they&#39;re famous here for is their tots. They have a full paged dedicated to 9 delicious and very different skillet tots that even Napoleon would dance his @$$ off for. They even have a dessert tot called the I Scream Tot, which I am very curious about. My favorite, so far, has been the Tater Skin Tots but I plan on coming back to try each and every one.",
