"rating":"4.0",
"reviewcomment":"Best wings I&#39;ve had in sd! They have so many flavors! Ahhhh!!!! I seriously wanted to try them all. Come for happy hour 3-6 and get them half off! Beware, though, happy hour means no leftovers can be taken. <br><br>Here&#39;s what I settled on:<br><br>Garlic parm - my fave of the bunch. No sauce, just butter and crispy garlic goodness....Mmm<br><br>Dirty ranch - my second fave. Buffalo and ranch mixed together in a perfectly delicious sauce<br><br>Lemon pepper - 3rd fave. Crispy and delicious. <br><br>Teriyaki - really tasty sauce, but a little too much of it for my taste. Once I dabbed some of the sauce off they were perfect. <br><br>3-Pete BBQ - doused in BBQ and buffalo. These seemed a little salty to me, or maybe just a little too vinegary. Not sure. They were good, but I would probably skip them next time. <br><br>There are so many more flavors I wanna try! And tots, fries, Mac and cheese balls...everything!<br><br>If I lived within walking distance I&#39;d probably frequent this place. Nice little dive with good music and music videos",
