"reviewcomment":"Love this place. Everything is organic and the burgers are top notch and simple.  They make the patty crispy crusty. I like their house made 1000 island sauce on the lounge burger.  There aren&#39;t a bunch of options for toppings except for bacon but I might ask next time (you never know... They might have an egg or some avocado back there in the kitchen).  <br><br>We always get the half and half fries and onions rings and although they are totally awesome (especially with their creamy ranch) we can never finish them because they&#39;re huge.  Guess I better choose one or the other next time... But always with the ranch! <br><br>What I love most are the drinks.  They&#39;re all natural and one of the cashiers was a genious and had an awesome mix: half pink drink, half orange dream, splash of ginger root beer.  So freaking good... And who knew?!  Definitely my fave burger place downtown.<br><br>We&#39;ll have to try their brownie next time and if we have room, their shakes.",
