"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/G9viZx2mu0WLN4niJWfOug/l.jpg",
"rating":"3.5",
"reviewcomment":"My friend and I have come to Big Kitchen Cafe before, but it was over seven years ago. We decided to try it again after all this time, its still good as it was back then.<br><br>The service is great here, servers are very attentive and friendly. The prices are amazingly good for such quality food you get. The selection of food is also massive, the menu is pretty big for a breakfast lunch place.<br><br>This time I tried the coffee cake and one massive pancake. The coffee cake was great, had walnuts and a great sweet flavor to it that went good with a morning cup of coffee. <br><br>The pancake was massive, huge. I finished the whole thing, but felt very stuffed afterwards. The texture of the pancake was perfect, nice and fluffy. Once you pour their melted butter on, its good enough without syrup. <br><br>My friend ordered a vegetarian omelet, and to her surprise they used a large variety of veggies that were cooked great. The omelet its self, was also very big.<br><br>When going to breakfast at this place, bring an empty stomach! Also bring cash, because they only take cash.",
