"rating":"4.0",
"reviewcomment":"**Biased opinion due to being in Starvation Mode, at least 30 min - 1 hour prior to arrival.<br><br>Walking into Smashburger and seeing the huge banner above &#34;$7.99 for Classic Smashburger, Fries, and a Drink!&#34; - AND being the Asian I was, I immediately knew I was getting. Boom, baby.<br><br>The original Smashburger is essentially: American cheese, ketchup, leaf lettuce, tomato, red onion, pickles, and their signature smash sauce on a bun. When you&#39;re starving, this is the best thing since sliced bread. Wow. Juicy, and full of flavor from the burst of pickles and onions - this was gone in under 15 seconds. No joke.<br><br>I requested the Smash Fries, instead of regular french fries, which is an interesting blend of fries that are tossed with rosemary, olive oil and garlic. Wow. And if you request chipotle sauce, it brings the flavor come to that much more &#34;UMPF!&#34; No but seriously, get some of these Smash Fries. They&#39;ll make you feel &#39;healthy&#39; while you&#39;re downing your meal, especially if you go fat boy/girl mode with a shake to boot. ;)",
