"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/ZaoOXHLwVojQTPDhGYBRIg/l.jpg",
"rating":"4.5",
"reviewcomment":"So Far in San Diego, this is the best Thai food restaurant.<br><br>We ordered:<br><br>Pot of Gold - Really good Appetizer, would recommend <br>Larb Salad - You have to like citrus, it&#39;s good but acquired taste<br>Waterfall Salad - I liked it, but probably not going to order again - it has a strange texture (sand like) that wasn&#39;t my favorite<br>Drunken Noodle (Pad Kee Moaw) - Oh man this is good, I would order this all day long, so goooooood..............<br>Masaman Curry with Beef (Gang Masaman) This dish sealed the deal, we will be back for more.  The curry was so good and the vegetables had to be the freshest I&#39;ve had at a restaurant. <br>Thai &#34;BBQ&#34; Chicken - this was good too, not the best dish but defiantly something to try.<br>Mango and Sweet Sticky Rice - Oh yeah, I can&#39;t believe we ate as much as we did.  The food was very good.  The desert was delicious. <br><br>This will be my go to place for folks visiting me and our go to place for good Thai food.  I hope that more people support this place and that&#39;ll be around for years to come.",
