"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/8KAJvbizm-Xj7-DTKP339A/l.jpg",
"rating":"3.0",
"reviewcomment":"If you are a sea food fan, this is the place to go. This is the place to go and definitely a must go for shrimps and crabs and lobsters. This place will give you the sea food over dose you would want. really flavorful and mouth watering cuisine.<br><br>Shrimp in a bag is a very unique style of cuisine and they have a very unique way of having your meal. You get a table and butter paper is rolled over the same and that exactly is your plate. You get your orders in a bag. If you are in for some citric flavor, I would  suggest to get few lemons, drop them in your bag and mix your dish, before eating the same. Be careful while you order the spice level for the dishes. The XXX is not for the weak at heart folks. I would suggest to even think of it once after you have done a Mild, which in itself is HOT. <br><br>It gets a bit messy while eating so be prepared for that. <br><br>They do accept cards and they have parking available as well.",
