"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/YLlqdl3_bBSZxQRnY14Neg/l.jpg",
"rating":"4.0",
"reviewcomment":"While staying in La Jolla for work, I checked out my dining options with yelp. This one looked really promising. <br><br>I made reservations through open table and was promptly seated upon our arrival. <br><br>The inside of this restaurant is so unique. The building use to be an Oldsmobile dealership back in the day so the old exposed brick is prominently displayed. There are real, live olive trees growing inside.  The building has a barn/warehouse like feel to it and the attention to detail with the lighting is incredible. <br><br>Our server, Matt, was great. He suggested some wonderful items for us and was very pleasant throughout the evening. <br><br>I ordered the corn chowder, the baja corn as a side and for my main dish I had the seasonal fresh pasta and added scallops. This dish was so divine and full of intense flavors. <br><br>For dessert we shared the sundae and the raspberry filled donuts. The sundae stole the show. <br><br>If I&#39;m ever in La Jolla again, I will definitely stop in for a wonderful evening.",
