"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/PTuv07UMdxfHGS59Er0glQ/l.jpg",
"rating":"4.0",
"reviewcomment":"I was looking for some close grub on Memorial Day and happened to find this gem still open.  For the impatient, then jist is to go here.  It rocks.  For those people who want the long story, see below.<br><br>I was hungry as hell.  It was late.  Hence, I did some Yelp research and saw that this place was practically across the street!  Before I walked in, I had decided on the Wild Burger with the deviled eggs as an appetizer. No joke, this shiz is the bomb.  The chili and caviar eggs weren&#39;t anything to write home about.  The prescuitto and confit eggs were phenominal.  Totally worth it.  <br><br>How was the Wild Burger, you ask?  Holy moly lamma jamma, that rocked.  The fries were amazing.  I have had truffle fries before, but these were amazing.  The burger was great.  I honestly wasn&#39;t a huge fan of the bacon, but the meal as a whole was fantastic.<br><br>I ended up coming back tonight and got the steak frites with one of the charity cocktails.  Good god almighty, the meal rocked too.  The cocktail was ridiculous.  I am in awe of this place.  Evan, the bartender and server, was extremely nice.  Tip him well!",
