"categorystrlist":"Burgers,         Fast Food",
"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/3EHVLeYpm_fX6AcDtsAFVQ/l.jpg",
"rating":"3.5",
"reviewcomment":"I&#39;ve been about three or four times to give Five Guys a legitimate chance.  A client of mine recently said they are the same as In N Out, I cringed at the thought.  I&#39;m quite fond of my double double.  The burger is generally greasier and more plain than In N Out.  I decided to mix it up this time.  I ordered a bacon cheeseburger with BBQ sauce.  This burger was not greasy, much better.  The BBQ sauce was good.  Recommend instead of the ketchup and yellow mustard.  The plain American cheese is already boring so the BBQ sauce spices it up.  Plus the cheese was cold, not melted at all.  Some cheese options would a nice.  And the bread could be better as well.  But overall the burger was darn good.  You get a bigger burger, plethora of soft drink choices, and free peanuts to munch on.  <br><br>PS: All the signs saying how Five Guys is the best is a bit much",
