"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/o04Bipq1x1Yxv6oEHymzYg/l.jpg",
"rating":"4.5",
"reviewcomment":"This place had me at fresh fruit and papaya mango smoothies. After a long day out in the hot weather, smoothies at Senor Mango&#39;s was honestly the best way to wind down and enjoy the rest of the evening. If you like papayas definitely give the papaya mango smoothie a go! You won&#39;t regret it. My girlfriend normally goes for the ice cream watermelon smoothie which has a lighter and more mellow flavor. Watermelon, banana, strawberry and vanilla ice cream is not the most conventional combination, but it is pretty darn delicious. <br><br>The tortas also hit the spot. Upon a recommendation of one of the people who worked there, we tried the Lomo and have been hooked onto it since. Good blend of flavors and  big portion size. <br><br>Because my girlfriend has never had acai, in a previous visit, we got the acai bowl to share. Although it&#39;s not really my thing I was impressed at how well balanced all of the flavors were. For her it was like eating chocolate, strawberries and granola....except a whole lot healthier.",
