"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/qRdxQ9sHQCB1S8QDxwTQZw/l.jpg",
"rating":"4.5",
"reviewcomment":"No pictures! Food was devoured upon arrival. Every time I try to come here the wait is long and I&#39;m usually too hungry to wait so I venture across the street. I&#39;ve been making a mistake this whole time! I should&#39;ve waited!! So many missed opportunities and regrets I must live with!!!<br><br>I&#39;m a thai girl that loves her food spicy! I read the reviews and saw that things tend to be extra spicier here, but I was feeling bold and daring! I ordered drunken noodles with &#34;chicken&#34; spice level 7 and even that was just too spicy for me. I still enjoyed my food, but behind tears and a runny nose. Sorry for the image! So here is your warning. THEY DON&#39;T PLAY WITH THE SPICE LEVELS. Proceed with caution. We also ordered &#34;chicken&#34; satay and flower cups as an appetizer. Both great things to start off with. We wanted to end our meal with mango and sticky rice, but they were all out of mangos!!! WHAT THE WHHHHAAAAT!!! I was incredibly sad, but I quickly hid my disappointment and picked the sticky rice and coconut ice cream. It&#39;s no mango and sticky rice, but it satisfied the need of something sweet and it was a great second choice.<br><br>The staff was really attentive and made sure we had everything we needed. My water cup was filled and that&#39;s all I really ask for in the end... water and great food. I can&#39;t wait to come back!",
