"categorystrlist":"Mexican",
"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/ob4nMRs9yPNX5lEKd4OAlA/l.jpg",
"rating":"4.0",
"reviewcomment":"Inexpensive food that is way better than most take away Mexican food establishments. I really like the California burrito. The fries are always crispy and the meat never is packed with that chewy cartilage, maybe a spot every 20 burritos or so.<br><br>The food is consistent and I always get what I expect, decent for the price. The customer service is great! Quick, polite, and no mistakes. I&#39;ve never had an order that was wrong.<br><br>The only negative point for me is that the doors are very hard to get in and out and nobody ever offers me help. But, I never ask for help so I can&#39;t say they don&#39;t help. I just hate asking for help when they are working their bums off trying just to make a living. I feel bad taking away from their potential tips just so they can let my crippled butt out the door :-)<br><br>I keep coming back for more. Keep up the good service guys, you&#39;re doing it right.",
