"rating":"4.0",
"reviewcomment":"another gem in little italy.<br><br>was hanging out w/ a friend and checking out her new place in the Aleggro building (the red striped building above Craft and Commerce). originally we planned to do dinner and drinks at C&amp;C but seeing as the wait was 40ish minutes and we weren&#39;t able to find anything at the bar, we decided to check out Isola nearby and then go back for more drinks (of course).<br><br>i love everything about this place. there&#39;s outside patio seating with heatlamps under the cool little italy night, the interior is spacious and trendy. true-to-form with many authentic and classic (yet modern and hip) italian spots, there were wine bottles and other spirits adorning the shelves, low accent lighting above each of the tables, a mini flower vase (aka mason jar) with a few tea lights and daisies. i was impressed. we were seated immediately and the wait staff were friendly and helpful in selecting our dishes.<br><br>the pizzas each were more than enough for one person, so it&#39;s nice to be able to have lunch already boxed up for tomorrow haha. they have other italian cuisine staples, an assortment of wines, etc. the dessert was killer as well: some sort of dark chocolate mousse with sea salt and whipped cream something or other. we loved it.<br><br>adding Isola to the list. definitely coming back to this place again!<br><br>-civilities.",
