"categorystrlist":"Coffee & Tea,         Cafes",
"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/Z4I0arm4_aR8iwUTsqF4Ow/l.jpg",
"rating":"4.0",
"reviewcomment":"One of the best cafe study spots in San Diego.<br>I would say... better than... Lestats on Park.. ok don&#39;t shoot me.<br>No but seriously though. It really is. <br><br>If you&#39;re in hardcore, &#34;I need to study for like 6 hours straight&#34; mode, come here.<br>Get here in the morning. Find parking either in their parking lot behind the building, or street parking in the neighborhood behind it. <br>Get in here. Grab a table. Don&#39;t be a douche and get a huge table if its just you. Get a small table in the backroom. They all have individual lamps and outlets. Wifi is decent.<br><br>People come in to eat full on meals here too, so try not to get too tempted. Or get tempted and order delicious food to eat while you study. Because pretty much all their food is delicious. Sandwiches. Salads. Bagels. Pastries. They got all the goods. <br><br>Put on your headphones. Sip on that headache inducing caffeinated creation. And get to work!",
