"reviewcomment":"A completely accidental discovery, but a very pleasant one... Really amazing place and with cool ambiance... The servers are really friendly and they have limited nice outside seating with fire lamps in case you need heat... <br><br>Had gone there vegetarian friends so ended eating veg but still was totally amazing... You can try their sampler plate if you wanna get yourself to taste a major chuck of what they have... A must have is their Saganaki / Flaming cheese (Pan Seared Greek Kassari Cheese finished with Metaxa Brandy and Fresh Lemon Juice)... A really unique and very cheesy dish but totally worth an experience.... I loved their Spanakopita, and Fiery Feta Mac &#39;n Cheese... The presentation of the food made the same just wonderful...<br><br>No matter what you have, make sure to save room for the Baklava. Their Baklawa was out of the charts and a must have according to me... It is the best I have ever had...<br><br>I would highly recommend this to all...",
