"rating":"4.0",
"reviewcomment":"My husband &amp; I had breakfast at Snooze in Colorado last year the morning he proposed to me.  I can&#39;t even begin to tell you how mother freakin&#39; excited I was to discover a SNOOZE just 10 minutes away from our hotel in La Jolla. God was truly on my side! Harhar.<br><br>We got there at a little after 8 am on a Saturday morning.  Surprisingly, they weren&#39;t as busy as I expected.  They had tables outside on the patio available immediately, but we were able to get seated inside within 5 minutes.  I got the OMG! French Toast and OMG was it delicious!  My taste buds were rejoicing at every bite. I also got a cup of cappuccino to perk me up for the day ahead &amp; wash down all the french toasty goodness.  My husband enjoyed his plate (corn beef hash?) &amp; coffee as well.<br><br>We were in a rush &amp; was able to get in&amp;out within 45 minutes. My husband even got a comfy t-shirt as a souvenir. Overall, the place is really trendy with employees to match ;) I love the vibe and can&#39;t help but reminisce about a favorite childhood show of mine, The Jetsons, everytime I&#39;m in there. I love Snooze!",
