"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/zEYzRgIoVuY_940QY_ekrg/l.jpg",
"rating":"4.0",
"reviewcomment":"Small casual, BBQ, sports TV &amp; beer. Outside patio patrons people watch... Inside patrons eat &amp; go... Not much lingering around here. Go up to register- pay, sit &amp; wait for your name to be called by the robust looking cook. You know what they say... If the cook is eating the food, it&#39;s goooood! BBQ ribs are large. BBQ sandwich full of your choice of meat-- order mild, medium, or spicy. I ordered medium and added more Sriracha! Special dinner of chicken thigh and leg comes w two sides. 5.99$. Awesome deal. Cash only. Paid about 20$ for 3 amazing tasting BBQ dinners served on a plastic cafeteria tray. No frills here, but you&#39;re here for the food! Went back twice the same week while on vacation. Take out is good too. Packaged sauce proof so no leakage in your car. Sides to order-- cole slaw, potato salad, beans, fries. I didn&#39;t try the other sides of Mac cheese. <br><br>Kiddo ordered corn dog- she ate it. All smiles. I didn&#39;t taste it, but I guess it&#39;s &#34;fine.&#34; Parking in street or Lot. Free parking. Market night tonight on Wednesday... So I ended up walking 3 blocks to get to eat BBQ items that used to have a face. For those veggie Tarians--- they have BBQ veggie platter too.",
