"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/HLVDfuBS7FKBO0V49onWUA/l.jpg",
"rating":"3.0",
"reviewcomment":"We were in for wings last night. All you can eat on Tuesdays.  Can&#39;t go wrong.  Right?   The hostess was very accommodating seeing we requested a booth (the only one left) that could have sat 6 even though we were only a party of 2. (Our bad). What started off with five stars quickly diminished to 1 star.  We were on our way out the front door after waiting at least 3-4 minutes to even be greeted by a waitress who stated that &#34;she wouldn&#39;t be taking care of us but she would be glad to get us started on some drinks before our server could help us.&#34;  But we waited about another 5 without seeing our drinks for another server to tell us our beers would be right up. Finally, after a few more minutes, our ACTUAL server approached the table (without our beers basically to verify that we had already placed our drink orders and that she would be right back with them.)  She wasn&#39;t right back...  We waited  as long as we could before we decided it was time to walk out and grab a beer and a bite elsewhere. This was the worst part about our dining experience here.  <br><br>     I want to thank the manager Nick for rectifying this situation quickly.   He caught us on our way out the door and provided quick resolution to the service and our experience.  I probably would say this particular experience deserved 3 1/2 stars max, solely due to the lack of initial service. (I&#39;ve never felt the need to walk out of a spot simply because I waited too long for some drinks...)  There were some other snafus along the way... Like never getting our waters until we had to ask again from another waitress and the wait time on our initial order of wings was a bit long.  I didn&#39;t want to leave 3 stars due to the fact that the manager took good care of us the rest of our stay and I believe her name was Katherine, but she was very helpful while relieving our actual server during her break (who we never caught the name of). The wings were great!   All in all, we left satisfied.  Thanks again Nick!",
