"rating":"3.0",
"reviewcomment":"I&#39;ve been here a few times. Every time I come customer service is excellent. The food is on point. <br><br>My first encounter here was for restaurant week with a friend. We ordered the prefixed options on the menu I believe I got the scallops appetizer, entree with the lamb and the crème brûlée. Everything was fresh served fast and delicious.<br><br>I went a couple other times. The last visit which was on Mother&#39;s Day was actually a very pleasant experience. We were greeted enthusiastically by the staff treated very politely. Although they mistook my daughter and I as a couple -  they were still nice. I want to tell you I did use a Groupon. I do not believe that made a difference in my service. <br><br>What we ordered for appetizers were at the sweetbread and the escargot. As for the entrées I went with the beef tenderloin and mashed potatoes. My daughter went for the lamb shank with a white bean confit. And the grand finale was our desserts. I&#39;ve had the crème brûlée before I can tell you it is pretty amazing. I tried out the bananas Foster cheesecake this time it was amazing!",
