"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/imvM084WSU7w76YTTeNXmQ/l.jpg",
"rating":"4.0",
"reviewcomment":"If you were ever wondering where Pee Wee Herman and his cast of animatronic furniture go out to eat breakfast, look no further. Sir Wafflelot! I smite thee in thy name of thy Eggsecutioner! Decor is a cross between any Brady Bunch hotel restaurant near Disneyland and a place Jules Winnfield might have to give up his Bad Motherfucker wallet. Has a colorful, quaint, aged feel and a nostalgic mustiness. Kind of like that dusty LIFE board game you haven&#39;t taken out of the closet since the Spring of 1979.<br><br>Anyway, the food: Not as good as Gramma&#39;s cast Iron Waffles but goddamn, no mortal can do that you prick. Light, fluffy, buttery deep crevices that cradle butter and syrup like a mother holding a baby. <br><br>Eat the baby!<br><br>Bill was cheap. Service was Jolly and quick! Parking was easy. Please visit this holy land as soon as you can.<br><br>TIP: Get the fried chicken and waffles special!",
