"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/p5e6GC1Gc208gTfhWIAH1A/l.jpg",
"rating":"3.0",
"reviewcomment":"PF Chang&#39;s is great, a few times a year. It&#39;s funny because we really like the food here, the Kung Pao Scallops, Mongolian Beef and Honey Shrimp are all favorite entrees and the Salt And Pepper Calamari and the Lettuce Wraps are great starters.<br><br>But for some reason, all the food tastes similar and it&#39;s not really authentic Chinese or even Asian. It&#39;s kind of its own thing with its own distinct taste. Everyone I know comments on this. And,while the food is great, it really is, it has such a distinct taste that I can&#39;t go there very often or I get bored with it.<br><br>So, if you&#39;ve never been try it out. You&#39;ll probably love it. Oh, and the drinks are amazing, especially the Key Lime Martini&#39;s, Nutty Uncle Chang and Buddha&#39;s Dream.<br><br>It&#39;s a very noisy, bustling place so don&#39;t go if you want a quiet or romantic dinner, but if you&#39;re looking for a fun, happening place, it&#39;s perfect.",
