"rating":"4.0",
"reviewcomment":"Best coffee shop in San Diego. Period. <br><br>Great lattes, great desserts, very cute ambiance, and always great people to talk to. <br><br>I used to come visit my girlfriend from Irvine when she lived in little Italy, and I loved walking to this cute coffee shop - Cafe Italia. Now, I&#39;ve lived in San Diego for two months and have been to at least 10 other coffee shops in and around San Diego. None of them compare to Cafe Italia. I come to Cafe Italia at least 3 times a week even though I live in East Village. <br><br>Cafe Italia has excellent lattes and cappuccinos. I don&#39;t know how they do it, but their froth is so thick, so creamy, and so damn tasty!! <br><br>Their biscotti&#39;s are to die for. It goes perfectly with anyone of their amazing drinks. Also, I would definitely try their gelato, especially their pistachio gelato. <br><br>Oh! What&#39;s great is that all the old Italian men in town also come to this coffee shop, and they all sit around and speak Italian with their crazy hand gestures. It honestly feels like you&#39;re in Italy. No joke.",
