"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/9pF7_fqg8T8HdTtWggZYcA/l.jpg",
"rating":"4.0",
"reviewcomment":"First experience here was last year and ordered garlic naan, lamb, and saag paneer. Oh. My. Goodness! Just thinking about it right now makes my mouth water! <br><br>Everything was excellently cooked, spiced exactly the way I asked for it to be and the flavors just came together real well. Other Indian restaurants I&#39;ve been to don&#39;t seem to put enough of a mix of spices to make the dish really come alive. Eating the food here is quite truly a treat for my palate. Everyone I&#39;ve brought here has been hooked. I can&#39;t even compare their food to the other Indian restaurants in SD which I have been to. I would rather eat here.<br><br>No the decor isn&#39;t as nice or fancy, the parking lot sucks balls when it&#39;s peak business hours for the strip mall, and for me living in Chula Vista and having to get stuck in rush hour traffic for an hour just to get a fix is always totally worth it. <br><br>If you&#39;re new to Indian or just love good deals and trying lots of food, their lunch buffet is pretty legit. My sister and I discovered the butter chicken this way... however nothing was spicy, to me anyway. I always order everything as spicy they could possibly make it.",
