"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/xJS3YqLFpbKaPF1PFcyO8g/l.jpg",
"rating":"4.0",
"reviewcomment":"One of the nicer taco shops in town. The quality of the mexican food here is a step above the others. Its cleaner and located in a plaza by the chase bank across rhor park. There is a lot available and shared with the other businesses in the plaza. The service is fast, and the staff is nice enough.<br><br>Their california burrito is a lot smaller than others in the area but the quality of meat is much better. The fries come crispy and their pico de gallo is great as well. Their rolled tacos come with guacamole, shredded cheese and sprinkles of cotija cheese. I always ask to add sour cream and pico de gallo on top. The rolled tacos are fried perfectly, and thoughtfully put together. Their carne asada fries and chips are always satisfying both visually and in flavor. The fries come shoestring style, and the chips are fried fresh. They have a salsa bar here with both the red and green hot sauce as well as radishes, carrots, and green onions.<br><br>I can only speak for myself, and i feel that this shop produces above average mexican food. It&#39;s fresher, of better quality, and flavors never disappoint me. I give this place 4 stars.",
