"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/Hag7LCqYsl4MKGbx9SC4dQ/l.jpg",
"rating":"4.0",
"reviewcomment":"I live in OB and this is one of my favorite local spots! Great atmosphere and generally a great crowd of people too, not as many douche bags as you find at Sunshine, Gallagher&#39;s, etc. Their burgers are outstanding (some of the best I&#39;ve had in San Diego) and the&#34; Dirty Jerz&#34; chicken sandwich is frickin&#39; amazing! They have a great beer selection, lots of craft brews, and they also have some good craft cocktails (try the Pisco Drink). If the food and drinks don&#39;t keep you coming back, the staff definitely will. The bartenders rock, super friendly, always willing to pour you a taste of something if you can&#39;t decide what to get, and all the waitstaff are also always awesome. And if you STILL need a reason to go it&#39;s dog friendly on the patio!<br><br>The only downside to this place is that it&#39;s a little on the small side so it&#39;s sometimes a little crowded, but that&#39;s not their fault, it just means it&#39;s a good spot :)",
