"rating":"3.5",
"reviewcomment":"My husband and I had our wedding at Bamboo Lounge. We held the ceremony in the back terrace and had the reception in their private room. This was followed by dancing and drinks in the main restaurant/bar. The terrace fit about 50 people, and there were 90 who came for the reception. I had so many guests compliment on the delicious appetizers and entrees, which were served buffet style. The ambience in the terrace was romantic, intimate, and classy. The event occurred at sunset and we decorated with flowers, candles, string lights, table cloths, and plate settings. There&#39;s a sound system back there for us to play our own wedding music for the backdrop to the ceremony. The only tip I have is to close the door between the main restaurant and private room because the noise from the restaurant will travel out, I just wished I would have realized this earlier. <br><br>The staff were very accommodating about letting us come early to setup, and making the space our own. They even gave us a complimentary champagne toast! I couldn&#39;t have asked for a more beautiful wedding.",
