"rating":"4.0",
"reviewcomment":"This place has definitely earned it&#39;s fifth star from me.<br><br>- Dive, dive, dive, but with the lights on it&#39;s surprisingly clean. No rips or tears in the booths or stools - well maintained with an old school vibe. <br><br>- Drinking on a dime. Hard to find these days but Nunu&#39;s keeps it real.<br><br>- That damn fried food! Healthy no, but one of their grilled cheese sandwiches or their sampler platter will add a few extra hours to your drinking schedule.<br><br>- The bloody is a must on a Saturday or Sunday morning. Took a while for me to order it, but it didn&#39;t disappoint. Half meal, half drink, all good.<br><br>- Now with windows! So, they added a window, which I think takes away from the dive bar experience, but it&#39;s always closed and there&#39;s a big black shade over it making it virtually invisible. Defeats the purpose? Nah, adds to the charm.",
