"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/uBgBJTp5dJXcfndjmbH9Eg/l.jpg",
"rating":"3.5",
"reviewcomment":"This is a review for the weekend brunch. We came last Sunday around 11:45a to a fairly empty restaurant. My first impressions were that it was very cute, cool neighborhood, open patio, beautifully decor&#39;ed (it is a wine bar after all) and $8 bottomless mimosas are a real bargain. The menu is limited during brunch but frittatas and waffles were excellent and reasonably priced. Even long after we paid our bill, our waiter still came around refilling our drinks. I would absolutely recommend it for a casual weekend brunch date. Minus one star for no air conditioning inside and the no substitutions rule even if you are willing to pay a little more. <br><br>TIP: Everyone in your party must be 21! The waiter asked to see everyone&#39;s IDs and I told him I wasn&#39;t drinking since I was the DD. He said it didn&#39;t matter- it&#39;s a wine bar.",
