"rating":"3.5",
"reviewcomment":"This is my second time at Buca. I like Buca because I know my food will be hot, will taste good and will receive great service.<br>However this location is quite terrible especially on Saturday nights cuz gaslamp is cray cray. Expect to pay $15 for valet from buca because you aren&#39;t gonna find any street parking. <br>Celebrated my birthday here and made reservations for 9ppl<br>We found all day public parking for $20 about 2 blocks away and decided that would be best since we were going bar hopping afterwards.<br>Everything here is &#34;family style&#34; portions meaning if you ordered the &#34;large&#34; size you could probably feed ~4 people. We were a party of 9 and ordered the ziti (cheesy baked pasta), stuffed chicken, supremo pizza and cheesy garlic bread $10. Every entree was about $30-35. They didn&#39;t charge us gratuity so that was nice.<br>They do a lot of cute things: souvenir birthday card, sing for you (cookie for your birthday?), souvenir pictures ( you get a small pix for free but the rest you must pay for!)<br>Service is wonderful! Our waiter was Phil and he made sure everything ran smoothly",
