"reviewcomment":"I have a soft spot for middle eastern food. I spent some time in the region when I was younger and the flavors here are spot on. I love all the spices! The things that really sold me were the garlic sauce and turkish coffee lol. Those two things instantly reminded me of my travels. The garlic sauce is a certain texture and consistency that I have had trouble finding in the US for years!<br><br>Prices are a little high, but the portions are large and the food is pretty rich tasting. I highly recommend their chicken shwarma sandwich, it&#39;s yummy and a comfort food for me. Their platters come out on small dishes, but it&#39;s definitely A LOT of food. Their pita is freshly baked and the baklava is wonderfully decadent!<br><br>If you like middle eastern food, this place will not disappoint!",
