"rating":"4.5",
"reviewcomment":"I had been craving pupusas for months...maybe close to a year when I last visited El Salvadoreno. Why did I wait so long? I have no clue....maybe because I didnt want to put on my bullet proof vest. The neighborhood isn&#39;t the most inviting but the restaurant itself is clean and welcoming. I have to say that it was well worth the wait. <br><br>I obviously went with the purpose to devour multiple tasty pupusas....which i did. But I was also drawn to the tamales for some reason and they looked good on the menu.  The pork tamale was absolutely perfect, filled with moist marinated pork, potatoes and chilies. So good that I even ordered more to take home.  These little banana leaf wrapped El Salvadorian tamales are culinary gift to the world or at least to my taste buds. <br><br>The pupusas were exactly what I was expecting......awesomeness! I ordered the revueltas and loaded them with curtido and salsa. What a great experience I had especially because I waited soooo long to visit. Service is good, prices are even better and the food....well you already know.  Anyone wanting to try to change things up a bit and not be disappointed need to try this little gem out.",
