"rating":"4.0",
"reviewcomment":"A bustlin&#39; diner located on Coronado that serves up breakfast reminiscent of home cookin&#39;. <br><br>Weekends are packed. When we arrived, there were groups of people standing around outside waiting for their names to be called, but the wait is quick (10-15 minutes) and worth it. There are booths available, but most patrons are seated up at the counter, which makes for the best experience. <br><br>For breakfast I ordered The Combo, which is two eggs any style, a choice of either 2 slices of bacon or 2 sausages, and pancakes. A few bucks more upgrades your pancakes to any of the other pancake selections noted on the menu; I ordered a nice stack of chocolate chip pancakes. <br><br>Clayton&#39;s also has non-breakfast items as well. They&#39;re supposedly known for their pies that have large &#34;dome&#34; tops. Their caramel apples that sit upon the countertop also look tempting. <br><br>Service here is wonderful and quick for being such a busy breakfast spot.",
