"reviewcomment":"I was in the area and decided to find a quick eat other than the Carls jr, kfc and wendys near by. I came across a delicious aroma as I parked behind Rubios. This scent directed me towards Gaglione Brothers. Man was I not disappointed, Corey gave my gf and I a warm welcome and seemed genuinely interested in making sure we had a pleasant lunch experience.<br><br>My gf had the cheesesteak sandwich and she finished it. The mix of onions,cheese and steak definitely hit the spot and with that warm toasty outside and soft inside of the bun it made it all that much better. i choose the buffalo sandwich it was delicious as well but I pretty much regretted not getting the cheesesteak after trying my gfs sandwich but it was still good.<br><br>We also had the garlic cheez fries which were delicious only thing is make sure you have a mint or gum for afterwards but the garlic breath would still be worth it hahah. I will definitely be back again and I will have the cheesteak sandwich.",
