"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/mv8hfpbG93j8DGNNU0t27A/l.jpg",
"rating":"4.0",
"reviewcomment":"Had a groupon for this place and I am so glad that I tried this restaurant. Bf and I went for a day early Vday dinner since we knew that it was going to be packed the next day, and also, the groupon stated that it wasnt valid for Vday, but I sure did not mind! <br><br>We were served with complimentary bread, chimichurri, some type of herb butter and olive stuff which i didnt like, but oh my! their chimichurri was AWESOME! I guess it was supposed to be for the steak, but i used it for my bread and it was delicious!<br><br>Our main dish was Parrillada &#34;El Conventillo&#34; for $44. It had short ribs, skirt steak, flap meat steak, chorizo sausage, blood sausage and sweetbreads served on a sizziling platter. It was alot of food for two people, but everything was yummy in the exception of the blood sausage. For some reason, I did not like the taste of it. It was my first time trying blood sausage and I like pork/beef blood dishes, but the taste of the blood sausage didnt appeal to my palate. <br><br>Service was good. Wish the server interacted more, but he was nice. I will be coming back to this place for sure.",
