"reviewcomment":"&#34;YEAHHHH MEATTTT!&#34; screamed my inner testosterone.<br><br>I came here for dinner and was pleasantly surprised to see the hustle, bustle, and bellows of orders amongst the staff. The aroma of Godly cajun spice was trapped in the restaurant, and it enveloped me completely. Man, this is gonna be good. I wasn&#39;t disappointed.<br><br>1 Hamburger, All the Way (see their menu, it&#39;s all the toppings in the color &#39;black&#39;). 1 Little Cajun fries. 1 regular drink.<br><br>Ok, here is the breakdown. On my burger, the &#34;all the way&#34; option gives you everything a burger from Five Guys requires to give you maximum satisfaction. There is an additional row of ingredients you can toss on (in the color &#39;red&#39;), I chose relish. The burger itself is INCREDIBLY juicy, and the juices that snuck onto my jeans reminded me of one of those model chicks in the Carls Jr commercial except.. I&#39;m a dude.. and I don&#39;t have a &#34;bossom&#34; like that.. moving on..<br><br>My &#34;little&#34; cajun fries order turned out out to be a HEARTY (that means, g&#39;damn) scoop of fries! I&#39;d say equivalent to the order size of my friends who ordered a combined &#34;Regular&#34; and &#34;Little&#34;! AWESOME! Their scented cajun powers overwhelmed my nostrils but my taste buds oozed happiness.<br><br>The regular drink is just a drink but their MACHINE .. oh boy .. the MACHINE was AWESOME! Click on a soda button thinking, &#34;meh, sure I&#39;ll take that&#34; and then say, &#34;what?! there&#39;s MORE?!&#34; Yup. There is. #muchchoice #suchhappy #wow.<br>Examples include: Coca-Cola becoming; Vanilla Coke, Cherry Coke, Cocaine, Etc Coke. Or Root Beer showing; Vanilla Root Beer, Regular. WOW.<br><br>All in all, AWESOME! Loved it! :D",
