"rating":"3.5",
"reviewcomment":"I came here a few times and all those times, I&#39;ve never been disappointed. From the security checking IDs to the waitress and staff, everyone was friendly and welcoming. This place is pretty big and spacious. I always come in the evening/late night assuming that it would be busy, but it usually isn&#39;t. There&#39;s plenty of tables and seats available. <br><br>Recently, I came for Taco Tuesday. They had $2 tacos, $4 patron shots, BOGO free Jell-O shots and a special on Mexican beers that I can&#39;t seem to recall. My group and I started off with free samples of daiquiris. Bob Marley, 4-Play, Miss America and True Blood are my favorites! This night, I settled for True Blood. Though it was Taco Tuesday, there was also a check-in offer on yelp that offered 20% off my entree with an order of daiquiri, so I ordered the Drunken Chicken Sandwich. Everything about this meal was amaaaaazing. The mini bulgogi burgers are delicious as well.<br><br>I love this place and the friendly atmosphere. It&#39;s a great place to hang out and grab icy drinks with a group of friends. They usually have daily specials, so definitely check this place out if you haven&#39;t yet!",
