"reviewcomment":"One of the actual better Mexican restaurants I&#39;ve been to in San Diego, although, be warned-parking is pretty scarce.  I arrived late for a luncheon with my coworkers but the manager and waitress handed me a menu and they were able to get me my dish right as my coworkers were served theirs.  I can&#39;t say if this would be appealing to other people that are all about authentic good Mexican food especially since my girl is a big time Mexican food critic (unofficially) but the enchilada was pretty damn good here.  <br><br>The waitress was constantly checking on us (that&#39;s a good thing) refiling our chips, drinks and asked if we need anything else.  They didn&#39;t charge us for group gratuity either unlike some restaurants still behind.  I believe there was supposed to be a new federal regulation on restaurant tipping and it states that there is to be no automatic gratuity charge to groups.  Unlike IHOP-had to pull up the federal law on them on my phone ad show them.",
