"rating":"3.5",
"reviewcomment":"Went here with a couple friends for happy hour... <br><br>Nice place with a good amount of indoor and outdoor (covered patio) seating. Service was decent, no complaints... <br><br>The name Valentinos makes me think Italian.. But actually they serve Japanese!... Looking over the menu, it does appear a bit pricey for a neighborhood spot... But their Happy Hour menu is awesome. Plenty of options to choose from for $5, $6, or $7!... A friend of mine who&#39;s Japanese says their sushi rolls aren&#39;t quite &#34;authentic&#34;, but that they&#39;re still pretty good.  I did try their California roll, and i enjoyed it! Their crispy chicken sliders were good as well... The Kobe beef sliders were okay, but lacked a little flavor in my opinion. Tasted much better once I put some ketchup on it! Nothing wrong with their veggie tempura either.. You get a large serving of it! (Yum!) check out my pics and u be the judge!<br><br>The atmosphere is a bit loud.. It was a little difficult hearing my friends sitting right across from me. But seems like a nice place to meet up with friends. Okay for kids during HH.",
