"rating":"3.0",
"reviewcomment":"I ate at Toscana after attending the RnR San Diego Health Expo for brunch. Overall I loved the food and service was good (after the fact. I will explain). I would go back and try another dish when I am back in San Diego.<br><br>The wait was about 10 minutes during Saturday brunch time (not bad). We were seated in the back patio, becuase I wanted to be outside but not in the sun. Unfortunately (i think) since we were in the back patio and the busy brunch hour, we waited for a while before our server came to take our order. Once we got over that waiting period, everything else was great. We weren&#39;t in a hurry so the waiting wasn&#39;t too bad for my bf and I. The server was very aware for making us wait and comp our drinks.<br><br>We ordered the Florentine Omelet (recommended by the server, b/c So California Omelet wasn&#39;t available) and Italian Salmon Carpaccio. Both great delicious dishes!!! The food was great, but service seems to be a common thing that needs to be worked on.",
