"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/_eYnjS3ICSpExFl6qSs-2g/l.jpg",
"rating":"4.0",
"reviewcomment":"I have been going to Trujillo&#39;s since i was a freshman in college. It is right on campus and it is open until really late. Even though it wasnt in my meal plan, sometimes i would have a craving for carna asada fries so i would HAVE TO get it. I have always been ordering the same thing but when i want to change it up a little i order their real mexican food. Always with a cup of horchata and a lot of homemade hot sauce. <br><br>Throughout the years i have been going they have renovated the place with a new music player and new TVs. So it looks a little bit more modern but u can tell that its still its own place. They opened another location i think in El Cajon because this store was doing so well, which is great to see. <br><br>This is actually the first mexican place i introduced to my sister cause she wanted to try carna asada fries. She loved it and every time i go i send her a picture of what i ordered and she gets mad. :D <br><br>I will have to say this is my 2nd favorite mexican joint in San Diego. But because it is so close to home and the food is pretty good, i will always be going here. :)",
