"rating":"3.5",
"reviewcomment":"Hands down my favorite taco shop in SD.  <br><br>Oh the many late night post-bar meals I&#39;ve had here...but then I wake up the next day and go back because I feel robbed of my sober enjoyment of their delicious food!<br><br>There is something about the food here that puts it heads above the rest of the shops around, and when I&#39;m craving Saguaros no other taco shop will do!  <br><br>I typically get a rice, bean, potato, cheese, guac, and carne asada burrito which is to die for...order it you won&#39;t regret it.  <br><br>I&#39;ve also had their rolled tacos, carne asada fries, carne asada nachos, and well the list goes on...and on....and I have not one bad thing to say about any of the food I&#39;ve had from here.  It&#39;s perfect in my opinion, the only thing that makes it even more perfect is large amounts of their signature red/hot sauce.  <br><br>Great....now all I can think of is how I need to get to Saguaros ASAP and eat a burrito!",
