"rating":"3.5",
"reviewcomment":"I can&#39;t believe I haven&#39;t written review yet for Saffron given all of the times I&#39;ve been here in the last couple years. For all of the classic dishes such as pad thai, drunken noodles, tom yum soup, etc, they&#39;re all prepared from scratch on site. Dishes do take a while to come out but its well worth it, everything comes out hot and fresh. Noodles don&#39;t taste frozen or overcooked. Tom yum soup is bold with the blend of spicy and sweet.<br>When ordering any of the chicken combos, you get you choice of 2 sauces, love their peanut and sweet pepper sauce. <br>A unique element of the menu is the addition of low carb and heathy items on the menu (or as I look at it, guilt free)<br>Lastly, next door to the restaurant is their take-out chicken place. One thing I really like about that menu is their picnic basket option. You get a whole chicken, a combo of egg and spring rolls, 2 different salads, rice, and a bunch of dipping sauces. Its enough to feed 3-4 people and comes in a awesome little disposable picnic basket.<br>Can&#39;t wait to come back again to Saffron!",
