"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/z17Atim6-3RNJBKUncfw0Q/l.jpg",
"rating":"3.5",
"reviewcomment":"Came here on a Saturday.  It reminded me how fun it was when I last came here, and I wondered why I waited so long to come back.<br><br>They seemed to have changed a few things, but probably for the better.  They moved the pool tables and added beer pong.<br><br>$5 cover on Saturdays.<br><br>Two DJs.  One near the front who plays more pop and EDM, one at the back bar area who plays hip hop.<br><br>Drinks are cheap.  How cheap, you might ask?  Go there and find out.  But trust me, after having been to other parts of San Diego (Gaslamp, Downtown La Jolla, Hillcrest, heck, even North Park), these drinks are definitely friendly to the pocket.  Let&#39;s just say you would think for a split second you were in a dive bar.  But no, you&#39;re in a nicer place with cheaper drinks.<br><br>Dress code isn&#39;t as strict as other places around.  I personally believe they are simply encouraging good times.  Not so pretentious, which I think is a good thing.<br><br>Since they got better promoters, there have been a lot more people at this place.  I&#39;d say it&#39;s worth the $5 cover.",
