"reviewcomment":"We eat here every once in awhile for weekend brunch when we crave Indian food.  It&#39;s definitely one of our favorites because of the lunch buffet - very reasonably priced at $9.95 and an excellent assortment of dishes.  I particularly like the lentil soup, the saag paneer, the veggie korma, and the chicken tikka masala.  Today there was a mock duck vegetarian dish that was excellent as well.  The desserts are perfectly portioned so you can try more than one - mango mousse, rice pudding, and gulab jamun - very tasty.  I think it&#39;s also a nice touch that they always serve a fresh and hot order of naan bread with your meal rather than leaving it on the buffet.<br><br>Of course, I must always mention that they are very dog-friendly on their outdoor patio and always welcome us with a bowl of ice water for our pooches.",
