"reviewcomment":"WOODSTOCK&#39;S PIZZA. soooo yummyyy..<br><br>I am so glad they have one so close to sdsu. because when I want a really good slice of pizza I know i can go there and I will always get the best. I always order the garlic bird because i LOVE GARLIC. but I have been willing to try new things recently and the fire bird is MUCHO CALIENTE! hahaha. <br>I love how everyday they have a different special and they also have game nights. There is a reason why people come back to this place over and over again. and it is because of their great quality fresh food, great happy hours, good beers on tap and tentative servers. <br><br>You can also get a coupon, for every 5 dollars you spend, you get a stamp on your card and when you get a certain amount of stamps you get a 10 dollar gift card for the place that you can use whenever you want. <br>I LOVE WHEN I SAVE :)",
