"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/HoYnQpVJhxditATYeFfIPA/l.jpg",
"rating":"3.5",
"reviewcomment":"Close to work, this restaurant is reliable in that I can drag anyone coworker off to lunch at Ranchos and everyone has been very satisfied with the food. The menu is far ranging. My brother, who&#39;s vegan, loves to have so many options and has enjoyed each meal he&#39;s made.  People at work haven&#39;t really caught onto it yet in large numbers, so if I have to have a discreet (gossipy) lunch, it&#39;s dependable for that reason too. <br><br>Anyway...back to the chow.  The portions are generous and delicious.  I don&#39;t know why, but the salmon Cesar salad is tastier than that served by the North Park Ranchos, but I haven&#39;t noticed a difference in any other meals - all have been excellent but the cheese enchiladas are my favorite. The rustic Frieda Kahlo-inspired decor is charming. Although it&#39;s difficult to find lousy Mexican food in the town I&#39;ve called home for 30+ years, including the inexpensive &#34;-ertos&#34; on every corner, Ranchos is among the very best.<br><br>Others have complained that the servers lack charm. I&#39;ve not encountered that problem. The people who work there are friendly and smile and joke more than I do.  They hover with refills without being  I also don&#39;t love it when waitstaff introduce themselves to me when they take my order, so unless someone is rude, I&#39;m happy.  Getting the check after a meal can be a slow process, which is only a small bother when I&#39;m in a rush, but I believe that&#39;s on purpose - they make an effort to not rush their customers. And in this day and age, that&#39;s another great trait.<br><br>Almost forgot to mention the small patio. It doesn&#39;t seat many but it&#39;s covered with plants and muffles the noise from Sunset Cliffs Blvd. It&#39;s cozy and pretty...another attraction.",
