"rating":"4.5",
"reviewcomment":"I am ALWAYS looking for new sandwich shops, and I can honestly say that I have found a new favorite. 4.0 Deli is everything you could want- friendly, fast, and affordable. <br><br>The guy working the counter, Matt, was sooo helpful and knowledgable. Being that it was my first time, I had tons of questions and he answered all of them with grace and tons of patience. What a nice guy! <br><br>He sold me on the Godfather and I feel as if I owe him my firstborn child. Seriously I think that is one of the top 3 best sandwiches I have ever had- and like I said earlier, I&#39;m a total sandwich snob. My friend ordered the off the wall, and while it was just GOOD- I would recommend something else because I know this place has better options. Namely the Godfather. Told ya I&#39;m obsessed ;) <br><br>They have a pretty fun selection of Snapple, which always earns extra points in my book. They also offer beer on tap and have happy hour... Seriously this place just gets better and better :)",
