"ogurl":"http://www.yelp.com/biz/surati-farsan-mart-san-diego",
"categorystrlist":"Indian,         Ethnic Food",
"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/YgbpD40upXGDwnXITxKivQ/l.jpg",
"rating":"4.5",
"reviewcomment":"One of my favorite Indian places in SD!<br><br>Unlike the common Indian food you see around SD, ie: Punjabi Tandoor, Royal India, etc., this joint is quite different. It is purely vegetarian friendly and mainly serves more snacks and light meals. Disclaimer: You won&#39;t find chicken tikka masala, etc here. My two favorite things to order are the Delhi Chaat and the Pav Bhaji. I&#39;m a light eater and these two dishes get me stuffed! <br><br>The Delhi Chaat is just to die for! It&#39;s basically  a dish with wheat crackers and chickpeas drenched in yogurt, spices, and different sauces (I can tell tamarind and the mint sauces are in there). When you eat it all at once the flavors just blend and melt together--amazing. All the complementing flavors and the various textures (crunchy from the wheat crackers and soft from the chickpeas) just make it so damn good. Just describing this is making my mouth water! It is a tiny bit spicy, but definitely tolerable for all spicy lightweights. A MUST ORDER!<br><br>My other favorite is the Pav Bhaji. This is a plate of 4 hamburger patties with butter on them and the main dish is this mix vegetable slurry (probably has some lentils in it). With a dash of lime and freshly chopped onions, this dish is the bomb! I love this dish because I love the flavors. It may not look like  fine dining, but believe me it is delicious. The first time I ever had this, I had no idea how to eat it so I kind of approached it as if I was eating Ethiopian food (the slurry flavors itself kind of reminded me of it as well), thus I just dipped the bread into the slurry. Didn&#39;t even know if I was eating right! O well, it doesn&#39;t matter as long as it gets into my tummy! <br><br>If you want another type of Indian food to try, go here!",
"reviewcount":"274",
"pricelevel":"$",
