"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/jVJ-OWbPNhHmOuQscNEz4A/l.jpg",
"rating":"3.0",
"reviewcomment":"Where else can you find live music every night of the week in Pacific Beach? NOWHERE, THAT&#39;S WHERE. I&#39;m a big fan of Tomcat Courtney and the jazz band that&#39; plays often, as well as the owner&#39;s daughter, who is a great singer. The employees are friendly and informative, but not overbearing.<br><br>The food is hit or miss, but it really pays to know what to order. I&#39;m always happy with the caesar salad, grilled shrimp, meatballs, bruschetta, tortilla espanola, and of course the hot bread is delicious. Keep it simple, enjoy the good wine prices and the atmosphere, and read the part of the menu where it explains that it&#39;s a slow service establishment: it&#39;s supposed to be reminiscent of European cafes where everyone is relaxing over multiple shared plates, not freaking out over how quickly and in what order their food will arrive. Come here to hang out, listen to some music, and get drunk. Don&#39;t come here for an extremely memorable or exciting culinary experience, or to be surrounded by the same boring characters you&#39;ll find at any other bar/restaurant in La Jolla.",
