"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/YJ1liX77wMaQkmFTxCSxww/l.jpg",
"rating":"4.0",
"reviewcomment":"I place that makes some good scones is alright in my book. I stopped in the Pannikin for some coffee and scone before heading over to the La Jolla Farmer&#39;s Market. I ordered the Americano and a cranberry scone (<a href='http://www.yelp.com/biz_photos/pannikin-coffee-and-tea-la-jolla?select=oyjYw3-qftj6jMYWjDsIGg#oyjYw3-qftj6jMYWjDsIGg'>yelp.com/biz_photos/pann…</a>).<br><br>The Americano was great with its smooth yet strong appealing flavor. The scone was terrific and I loved the light brown color and gentle exterior crust (<a href='http://www.yelp.com/biz_photos/pannikin-coffee-and-tea-la-jolla?select=oyjYw3-qftj6jMYWjDsIGg#s9HYD-gHwAZs9GAIfas1Kg'>yelp.com/biz_photos/pann…</a>). The inside was very moist and crumbly, and it was loaded with sweet chewy cranberries. It was baked just for the right amount of time. (<a href='http://www.yelp.com/biz_photos/pannikin-coffee-and-tea-la-jolla?select=oyjYw3-qftj6jMYWjDsIGg#WPbDudIYiuDSNa-SLAGkFg'>yelp.com/biz_photos/pann…</a>) Great scone..<br><br>The provide a good solid Wi-Fi connection and have amble seating outside and comfortable seating inside. The hospitality was very warm and welcoming. Feed me a scone and watch me smile..",
