"categorystrlist":"Mexican",
"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/s4eeepk8t3lEFySiVCY5Bg/l.jpg",
"rating":"3.5",
"reviewcomment":"I had a lovely meal here with my boo and his parents. We went for dinner last week and we all had something different. <br><br>My dude had mole rojo, which was very good, but extremely rich. I had the steak with veggies (cactus, asparagus and carrots) which was cooked perfectly. The Mrs. had the MOST perfectly cooked piece of white fish I&#39;ve ever seen and my boyfriends father had the lamb, which had quite an extravagant presentation. <br><br>We were surprised to see soooo many gluten free options (we had a celiac in our group) and service was incredibly accommodating. Additionally, the restaurant was very interesting... Lots of items to look at. I couldn&#39;t have asked for a better meal.",
