"rating":"4.0",
"reviewcomment":"Wanted to try a new place other than what the main streets of Hillcrest has to offer (and often go to eat) And a grand experience of taste was eaten! Heard a rumor from patient that there is a place just around the corner of UCSD hospital where all the doctors, nurses, and staff members go eat. Well certainly no lie there, after we sat down three nurses, staff member and two doctors come in. <br><br>Came in and checked out and noticed they have lunch combos. Order the combo #5 came with a Gyro (stuff with tons of meat! Not like other places you are eating and there is only like 2-3 strips if meat, this was stuff). If also came with either fries season with their salty n spices seasoning or basmati rice mixed with herbs (I got the rice), along with a Greek salad with a free canned soda! <br><br>It was very tasty! The gyro I couldn&#39;t put down highly recommended.<br><br>The rice was hot off the place good along with a fresh Greek salad with feta cheese crumbles! Yum!<br><br>The restaurant it self is bigger than how it looks. It&#39;s very nice décor. A lot of windows, flat screen tv, and fountain. If you check In on yelp you get $2 off your bill!!<br><br>Good place for lunch! Will return again! :)",
