"reviewcomment":"My boyfriend said, &#34;Lets go to [another seafood place] for dinner tonight.&#34; Coming from my east county history of that chain and this one, I knew I had to introduce him to the delicious-ness that is the BRIG.  I had never been to this location, but I was just as impressed!<br><br>Upon first spoonful of the chowder, it was an instant win for him. (A big &#34;woo!&#34; for me who suggested this...)  We also munched on the calamari which had a great dipping sauce.  From there, he had the seafood sampler (fried seafood... how could you go wrong?!) but also the potato salad is <a href='/redir?url=http%3A%2F%2Famaze.com&amp;s=8ac205a7b04bc939378faf05495b72d194317158668902471dff1388888eb84d' target='_blank' rel='nofollow'>amaze.com</a>.  I had the Seafood Louie, which I should have gotten the dressing tossed in.  The salad is much too large to conquer mixing the dressing in which all the toppings!  I&#39;d even try maybe a lighter dressing with it next time and probably love it even more.<br><br>During past visits, I had the fish tacos, which are hands down incredible.  Try them!<br><br>Seriously everything is amazing. If you are considering somewhere else for seafood, just STOP and come here (or the one in East County).  I have never been let down by this place.",
