"rating":"3.0",
"reviewcomment":"Love this place! <br><br>They make a really tasty California, my FAVORITE burrito there -- I also really like the cheese and beef enchiladas, chimichangas (so good!) and their rice is top of the line!<br><br>It&#39;s a super friendly staff--I&#39;ve placed all sorts of unusual requests (like a rice, egg, and cheese burrito), and they&#39;ve been fine making it...and it was amazing. Plus they have daily specials that are seriously great deals, like Monday monster burritos (these HUGE, double tortilla burritos, are like $6). Great salsa bar too - you&#39;ve gotta try the tomatillo salsa!<br><br>They also have a great environment -- always something good to watch on the TV (and they just got another TV, too!) and just a nice, friendly atmosphere. I used to go there to get schoolwork done all the time. Plus, outdoor seating, which is so nice on sunny days.<br><br>As a UCSD student, I really appreciate the location so close to campus and also the affordable price. I see a lot of UCSD students when I&#39;m there, so I know it&#39;s well-liked by other students, too!<br><br>It&#39;s the only place like it for a good 5-10 miles.  A great find!",
