"categorystrlist":"Lounges,         Asian Fusion,         Sushi Bars",
"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/owkrn4SosH8Szmk89LjfRA/l.jpg",
"rating":"3.5",
"reviewcomment":"I don&#39;t know the difference between good and bad sushi because I only eat the veggie kind, but I can tell you that I liked the ramen a lot--particularly since they have a broth choice to make it vegetarian. THANK YOU! You can also add tofu to the soup (it isn&#39;t listed on the menu, however). I was pretty pleased with the amount of veggie options on the menu--and thanks for having TWO veggie broth choices.<br><br>So, I&#39;d say the veggie options are worth the money and tasty. My husband liked his fish rolls (not sure what he got, sorry), and said they were about on par with other, similarly priced sushi.<br><br>The service at this restaurant is 5 stars. The waitress knew EVERYTHING about the menu: what was vegan, veg, how to make something veg, whether something was worth the time or not, and even pointed out that instead of getting a large jug of sake, my husband and I should just check in on Yelp to receive two smalls for free. I wish I knew my waitress&#39; name, because she was amazing. She adds a ton of value to Dragon&#39;s Den.<br><br>FYI: The sushi closes up at 10 pm, but the hot/cold food kitchen stays open for the duration of the night.",
