"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/b49oWwgdJwKoA68u5ielEA/l.jpg",
"rating":"3.0",
"reviewcomment":"This is my go-to sushi place in my area! I&#39;ve been going to this place for a while and it&#39;s delicious! I was surprised how much sushi you can get for their price, about $6-8 bucks for about 10-12 pieces of sushi. <br><br>Their sushi is pretty good too and I&#39;ve never had a problem after I order getting my food on time, even when it&#39;s busy there. Depending on the week, they have sushi specials located on the whiteboard at the back of their restaurant for about $5. Me and my boyfriend usually end up getting the fire roll to feed the spice we need in our lives, along with the crunchy roll because it&#39;s my favorite or to just tame down the heat from the fire roll! They serve your crunchy roll warm because that&#39;s how you know it has fresh tempura in it! Also there is a bar. <br><br>Downside is that at night there is always a lot of people, but you can always call in for take out and pick it up. The place is kind of small. Sometimes it takes a while to get seated if you&#39;re lucky. Depending if it&#39;s really busy it can be hard to catch the server&#39;s attention.",
