"rating":"4.0",
"reviewcomment":"This is a lot more than a bagel shop.  The  bagels here are phenomenal.  Not exactly health food, but if you are in the bagel and cheese mood you will not be disappointed!<br><br>I worked in the shopping center here for about a year, so I know how consistently good this place is.  The pizza bagel is great, and you will usually have leftovers unless you are really hungry.  <br><br>Any if the open faces bagels that are baked in the oven with cheese and toppings are great.  The juice is freshly squeezed and the workers are friendly.  This is a local spot and a great place to sit and pass the time with a friend or on a lunch break.  <br><br>I  am not really a bagel person, so the 5 stars says a lot.  The place is always clean, and the workers being friendly is a big plus.  They also would offer me a small discount for working locally which I loved.<br><br>Very fresh, friendly and consistent.  I hope this place sticks around!",
