"rating":"4.5",
"reviewcomment":"Passed this place a bazillion times and finally stopped in for breakfast. YUM!!<br>I love the little outdoor patio, anytime I can eat outside I am in heaven. And from our table we had a view of the beach - small - but it was a view. :) <br><br>The indoor area has a darling little fireplace and I would love to sip a hot mocha by that fire in the winter. Cozy and quant<br><br>The gal at the counter was very friendly and although there was a line to order she took her time with each group ahead of us and didn&#39;t make anyone feel rushed. In fact, she was one of those people that gave you her undivided attention while taking your order- personable and kind.<br><br>I ordered the French toast with the berry and cream cheese topping. The berries were soo good! My daughter had a omelet that she loved, and we both had iced coffee.<br>We split a piece of coffee cake because I had to try it. <br>All the above was about $25.00 which I thought was a great deal.<br><br>The food came out surprisingly fast and we enjoy everything. I won&#39;t be as quick to pass this place now that I know what a treasure it is.",
