"reviewcomment":"We used Miho Gastrotruck for our wedding last weekend. They are amazing! Food tastings...out of this world. They offered us full portions of the food options and it was a difficult decision! We booked them right off the bat it was so good! They were very accommodating, even creating a menu option for a guest of ours that could not have casein (milk protein). While people were inside the venue during cocktail hour eating the yummy apps, we were outside having photos taken. Miho staff made sure that we got at least 4 boxes of the Truffle Fries and another appetizer while we were waiting! Best service ever! We chose Truffle Fries, prosciutto wrapped asparagus, chicken skewers for appetizers. Pulled pork sammy, chicken biscuit, Burger and portobello mushroom burger for our main courses. Potato salad and fresh green salad for sides. Everyone raved about the food and are still telling us about it a week after the wedding! Friendly staff and delicious, amazing fresh food! We highly recommend Miho Gastrotruck for any event, or any time you see their truck! Thank you Miho!",
