"rating":"3.5",
"reviewcomment":"Sooo I&#39;ve never eaten lobster in Boston *but* this is the BEST lobster roll I&#39;ve had outside of Maine!  Is it expensive?  Sorta-ish.  Is it worth it?  ABSOLUTELY!<br><br>What can I say that hasn&#39;t already been said...huge chunks of lobster, lightly dressed with mayo on a lightly toasted buttered bun.  It&#39;s the things dreams are made of.  AND, if that&#39;s not enough - it&#39;s customizable!  Don&#39;t want useless foul celery messing up your tasty lobster?  No problem!  <br><br>I had the large roll because my eyes were bigger than my stomach and I didn&#39;t comprehend that there could be such thing as too much lobster.  Lucky for me I had some bisque leftover and dropped the extra pieces of the happiest meat on earth into my take-home soup.  Also, there were no pieces in my soup to begin with.  Was that a one-off?  C&#39;mon, who doesn&#39;t love some knuckle meat in their bisque.  Am I just getting greedy?  Maybe.<br><br>Was here at about 3 on a Sunday.  We were the only people in the place.  No lines - score!  Now I&#39;m going to dream about lobster all day.  Great.",
