"rating":"3.5",
"reviewcomment":"We&#39;ve been on a mission to find a new sushi home ever since Ono Sushi closed. I&#39;m soooooo happy to say we&#39;ve come home!<br><br>Sabuku sushi is sooo sooo delicious.<br><br>The man&#39;s absolute favorite is the stuffed tunato inside it has seared scallops in a spicy sesame ginger aioli that is all wrapped up in yummy tuna and topped with re tempura crunchies, scallions, kuro goma &amp; a dash of sriracha.<br><br>A bit if a differentiator that Sabuku offers is their bacon menu. It seemed weird at first like a novelty, but it&#39;s actually rather delicious. My favorite is the BTA.  Inside it has 2 slices of bacon, spicy tuna &amp; your choice of either: avocado or asparagus (I reco the Avo) sauce, yuzu wasabi bin, bacon garlic aioli &amp; sriracha then they top it with tempura crunchies, scallions &amp; kuro goma. <br><br>They make you feel very welcome here. I read another review that talked about the owner being very rude. I can&#39;t speak to that experience but I can say that the owner has never been anything but warm and welcoming to us. I absolutely love it here and if you&#39;re looking for some delicious sushi this is your new favorite place.",
