"reviewcomment":"I couldn&#39;t have been happier with the service that I received over the phone from Melissa and the owner. <br><br>I am not a coffee snob by any means and I wanted to get a gift for my boyfriend. He loves his kona coffee but is not willing to spend an arm and a leg for it. <br><br>Melissa was extremely helpful in helping me pick out a variety of different coffees for my gift. She even gave me the cheaper price that was quoted online since it was different from their store. The owner also said he would ground up the coffee for me since the variety I wanted only came in whole beans. <br><br>I really needed to get this gift by Tuesday and since I had no time to pick it up at the store Melissa was willing to work with me to get free shipping if I spent over $50.00. The owner even waited for her to finish placing my order before going to the post office to make sure I could receive everything by Tuesday<br><br>Great service!!!! Looking forward to visiting your store",
