"rating":"4.0",
"reviewcomment":"This restaurant always leaves me speechless and amazed! Absolutely the best of the best! I would give it 10 stars if I could! Our server, Eric, was extremely knowledgeable and spoiled us with impeccable service. He was even able to tell me which of the Chardonnays were un-oaked! <br>We started with the most delicious crab cake I&#39;ve ever had. The lemon beurre blanc that accompanied it was simply unreal. We literally (not really lol) licked the plate clean.<br>I had the filet mignon which was pure perfection. The mashed potatoes were to die for. <br>My boyfriend ordered the seared yellowtail and it was so good that I don&#39;t think he even stopped to breathe. Luckily he let me try a bite and OMG the flavors!! Everything complements each other amazingly and leaves you salivating for more!<br>My favorite desert was the Key Lime Pie which I don&#39;t normally go for. I heard the table nearby raving about how it took them back to Key West so I had to try. Seriously the best pie I&#39;ve ever had! <br>The views are spectacular! You feel like you&#39;re literally sitting on top of the water and it really just doesn&#39;t get better than this!",
