"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/eryErs9JwCyysFh1pm69MA/l.jpg",
"rating":"3.5",
"reviewcomment":"Lots of the reviews are spot on, so to sum it up: Food is awesome, service was fair, but I&#39;ll explain. For some reason, it was full when we got there on a Tuesday night, near closing, and the staff were running around with their heads cut off in the most figurative sense. Being that my wife and I were shabu virgins, we were hoping to get some help with what to do. The staff was too busy, but we got our cues from everyone else who ordered similar to what we ordered (the sukiyaki), and proceeded to swish like pros. Ladles? Who needs ladles when you have a nice soup spoon and chopsticks. <br><br>I&#39;ve given the full 5 because the server waived the sharing charge. Now THAT is customer service and for me, that counts for much. I&#39;ll be back even if they charge me double next time -- yes, the food was that good. I left happy and full. High fives all around....",
