"rating":"3.5",
"reviewcomment":"&#34;A great anytime treat to cool the body using more ingredients than you can you can imagine.&#34;<br><br>Conchings is a longstanding Filipino-American food joint located inside the plaza just off Plaza Blvd. Going inside you notice Filipino&#39;s working and serving customers left and right, and the red and white booths and chairs sitting numerous people having lunch or dinner, the food here is great, but there&#39;s one thing you MUST try while eating at this establishment: Halo-Halo. <br><br>Halo-Halo, also known at &#34;Mix-mix&#34; is a Filipino dessert that lives up to it&#39;s name, it&#39;s a tall cup consisting of sweet ingredients ranging from sweet beans, lechè flan, two different colored jellies, other goodies, ice, and condensed milk. You&#39;re given one choice here, and it&#39;s the ice cream scoop delivered on top of all the other stuff, it&#39;s a refreshing treat to enjoy whether you mix the ice cream with the other ingredients, or eat it from top to bottom, either way just dig in, it&#39;s great.",
