"rating":"3.5",
"reviewcomment":"From the moment we walked in the door it was a great experience.  It was late when we arrived and we weren&#39;t sure if they were closing, but we were invited in with smiles and welcomes and even waves from the chefs in the back cooking.  We asked if they could make a jalapeño margarita even though it was not on the menu and without hesitation the answer was yes.  Our server disappeared while we browsed the menu and returned shortly with a pitcher of what was one of the best jalapeño margaritas I&#39;ve ever tasted. Turns out, our server Eric (made sure to remember his name specifically for this review) hand made the margaritas with fresh jalapeños just for us. <br>The food was delicious too. Between the three of us, we had the fish ceviche, lobster enchilada, chile relleno, tortilla soup and a beef taco. Plates were practically licked clean - everything was perfect.<br>All in all it was a great meal and the best service I&#39;ve received in a while.  <br>We will definitely be back and ask for Eric to make is his tasty jalapeño margaritas again and then maybe again....",
