"rating":"3.0",
"reviewcomment":"We caught them at a horrible time around lunch and service ended up being horrendous.<br><br>But lets forget that and review the food and drinks:<br><br>I ordered a soup, salad, chocolate shake and a Reuben.<br><br>The soup was mediocre, and served warm rather then hot. I would&#39;ve preferred it very hot, which could have improved my opinions on the soup from the start.<br><br>The salad was surprisingly good. It was a very basic prepackaged salad mix with iceberg lettuce and carrots, but it seemed to be very fresh and as a result i thought the salad was very good. **Funny how easy it is to make a decent salad, just need fresh ingredients! :D<br><br>The chocolate shake was not my favorite. It was delivered too runny and almost seemed like chocolate milk, but the flavor was alright. I really like my shakes to be a good thick flavorful drink. It should be slightly difficult to drink it through a straw rather then be like your drinking chocolate milk.<br><br>The Reuben - The reuben was filled corned beef, swiss, and sauerkraut. The sandwich was flavorful and good to the very last bite. This sandwich saved the review. It wasn&#39;t the best reuben i&#39;ve eaten, but it was a good one that i&#39;d eat again given the opportunity.",
