"reviewcomment":"The Wednesday Night - Tour de Restaurants of India Street!<br><br>Po Pazzo is probably one of the fancier establishments on India St. It was pretty empty on Wednesday when we were there, I think its probably more packed on the weekends though. I enjoyed all the food and wine I ordered, the short rib stack for the appetizer and cucumber salad were both good ones and for the Entrée I went with the Oreganata Chicken. You get two good sized pieces of chicken with it. My friend and I both liked it. My other friend went with the seafood dish with half the oceans sea creatures in it, for those seafood lovers out there. We definitely left satisfied and I also went home with the second piece of chicken for lunch the next day. Glad I finally got to try this place.<br><br>Let the food journey continue! On to the next restaurant next week!!",
