"rating":"3.5",
"reviewcomment":"I&#39;m going to have to give it up to Ruby&#39;s. I&#39;ve been coming here on and off since 1998 and this last visit had me walking away pretty happy!<br><br>Of course I had their Swiss Mushroom Burger on wheat with sweet potato fries! I love how the bun is not engulfing the meat and it falls apart while you eat it. Their Ruby&#39;s sauce is to die for, which makes this burger special.<br><br>I shared a banana chocolate milkshake with my lovely wife, which was one of the best shakes I&#39;ve had in a long time.<br><br>Coupled by the fact that they just renovated the joint and their service was very attentive, Ruby&#39;s has lots to offer being right smack in the middle of the mall.<br><br>Don&#39;t hesitate next time, even if there is a line! I&#39;d also recommend their tuna melt!<br><br>Oh, I&#39;m glad they got rid of their old uniforms. YUCK!",
