"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/Rf6vqJiwRDWbyYsRQ1041w/l.jpg",
"rating":"4.0",
"reviewcomment":"My friend took me here for my birthday and it was a really pleasant experience!!<br><br>It was my first time ever trying Peruvian food but I wasn&#39;t worried because she&#39;s been here often and I&#39;d seen amazing pictures.<br><br>It was crazy to me when I realized that all the seating was outside, but I don&#39;t go out much in this area -- they had nice heat lamps though -- I was never cold. <br><br>She ordered for me and we had some really amazing soda -- tasted like -- bubblegum -- in a yellow can.<br><br>I loved the huge &#34;corn nuts&#34; that they have out as an appetizer. We ordered the seafood ceviche and a steak dish. I loved them both! They had really quality cuts of protein and the flavor combinations were delicious. <br><br>The seafood ceviche&#39;s tart, citrus dressing was amazing! <br>The steak dish with tomato (it&#39;s one of their specialties) came with rice and half ways through eating it I started to get a very nolstalgic feeling that I was eating an asian dish I loved from somewhere. .<br><br>Thank you for an amazing B Day Dinner -- it was the best one I had this year :)",
