"reviewcomment":"Went to Harbor Town for Cinco de Mayo and there were 2 awesome things that happened.<br><br>1. with every margarita.. a chance to win a trip to Cabo or $300<br>2. a DONKEY came into the pub! A real life DONKEY to pet and take photos with (not selfies, a Donkey&#39;s head is too big to get into a selfie) #heehaw<br><br>Very fun, casual, atmosphere! Nice waitress, she split the bill for the party of 6 and was friendly.<br><br>On to the food:<br>I had a black bean burger, it was amazing! It had goat cheese spread and tomato pesto sauce and sprouts. the burger was good with good flavor! I dont like chipotle flavor so I got that sauce on the side.<br>They came with fries that were excellent!!<br><br>Friends had:<br>Mahi Tacos - 5 stars<br>Chopped Chicken Salad - 5 Stars<br>Steak Tacos - 5 Stars<br>Steak Cheese Fries - must i even say?",
