"reviewcomment":"Probably my favorite Vietnamese place!  It&#39;s clean, the service is good, and the food is fresh and non-greasy.<br><br>Recommendations: Nem Nuong Cuon and Banh Xeo.<br><br>Nem Nuong Cuon is a spring roll with a pork paste sausage and a super delish crispy egg roll wrapper.  It&#39;s light and easy to eat and doesn&#39;t make you feel gross afterwards.  The sauce it comes with is also incredible.  I&#39;m not really sure what it&#39;s made with but man, it is good!<br><br>Their banh xeo is huge and also incredibly not oily!  A lot of times, you get these at other restaurants and it&#39;s kind of greasy.  This one is fresh and tasty.  They do a good job with the pancake.  The insides could use more meat/shrimp.<br><br>Everything else from vermicelli noodles to pho to the drinks are also very good.  Definitely a place to go!",
