"categorystrlist":"American (New)",
"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/Kb9Zmc4szPfxbSGRMhKisQ/l.jpg",
"rating":"4.5",
"reviewcomment":"Got to try the lamb lollipops for a snack and knew I want to come back ASAP to try more. The menu features ingredients that are flavorful and freshly made, with a kitchen you can see into as they prepare your food. It&#39;s a very small place located in a strip mall next to a liquor convenience store, so nothing special in ambience but the food is so tasty! <br>The lamb lollipops were perfectly cooked with a crispy char on the outside and juicy meat on the inside, amazing marinade and hoisin sauce on top, served with coconut jalapeño rice as a perfect side. Although it was listed as an appetizer it would make for a perfect meal. The other menu options that were recommended by the hostess for next time were the burgers, and the chicken Caesar salad! They serve beer and wine too, and the Belgian white ale(can&#39;t remember the exact name now) was the perfect drink to accompany the dish! <br>My friends that saw my snapchat of the lollipops were drooling and couldn&#39;t wait to try it themselves! I highly recommend this food. Afterwards take a 7 min stroll down to Windansea beach to watch the surfers and crashing waves on the rocks!!!!",
