"categorystrlist":"American (New),         Cocktail Bars,         Wine Bars",
"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/MzfCJJpEpXjpeJ6i8lxfmw/l.jpg",
"rating":"4.0",
"reviewcomment":"Took my family here to celebrate an early Mother&#39;s day and my brother is a huge fan of Top Chef so it was the perfect place to go!  Made reservations so we were seated immediately and we were right next to the open kitchen where we can see Richard cook! The open kitchen is beautiful and Its fun seeing the chefs at work. Our server was friendly and very knowledgeable with the menu. He answered any question I had and made great recommendations.<br><br>The food was presented beautifully and each course came our at an appropriate time. Ordered the biscuit to start with and it was light, warm, fluffy. Basically whatever you imagine a perfect biscuit to be, I felt it was that. My family and I ordered a little bit of everything in he menu. We had one pork dish, chicken dish, 2 pasta dishes. All beautifully cooked and all equally delicious. Everything that came out of the kitchen it was always that moment when you say &#34;omg that looks so good I should&#39;ve ordered that too&#34; <br><br>My family and I had a great time and it was fabulous dining experience. Well done Richard and thanks for stopping by our table to chat with us for a little!",
