"rating":"3.0",
"reviewcomment":"EDIT: A couple of weeks after writing this review, I went in to pick up lunch for my coworkers. The manager, Kristen, came out to personally apologize to me for the experience I had at Jose&#39;s that caused me to write the review below. I was surprised that she knew who I was, but my coworkers and I have a very specific and unusual order. She explained that the new worker misunderstood the training. The personal apology from the manager was enough, but she proceeded to tell me that the order I was picking up would be on the house to make up for my previous poor experience there. I take everything back I said about their customer service; Kristen went above and beyond to prove that Jose&#39;s Court Room truly cares about their customers! I am on my way to pick up lunch for my coworkers and me again right now! :) <br><br>I&#39;m really not one of those complainy customers, I swear. I pick up lunch here maybe twice a week and order the same thing: 2 sides of refried beans that come with free chips and salsa... or so I thought. Today I ordered exactly the same thing I have been ordering for months, and Ryan behind the bar gives me my receipt, which included a $3 charge for the chips and salsa. I explained that this has never happened, said I dont want to pay for it, and he just said &#34;Sorry, but thats how much they cost.&#34; He made no attempt to help me out or find someone who could help me understand this apparent mix up. Didnt even offer to take back the food and give me a new receipt. I left very dissatisfied and he showed no sign of concern.<br><br>It just seemed too unlikely that every other server who has helped me with this exact same order for the past six months has made a mistake and not charged me. I later find out from a coworker that this guy Ryan is new behind the bar and had been messing up orders unapologetically when she went in hours later. <br><br>As a customer service employee, I expect others in the same position (especially in the affluent area of La Jolla) to hold themselves to high standards of service. Unfortunately, this place just doesnt cut it. I&#39;m really disappointed.<br><br>Their food is decent tasting but overpriced. The only reason I eat here is because I work across the street.",
