"reviewcomment":"We moved here a year ago and Italian is our favorite food to dine out.<br><br>I will keep it simple: this is the best we have had in San Diego. It rivals Chicago&#39;s Rosebud Little Italy. Having said that, we have not been everywhere Italian in SD yet.<br><br>The service was outstanding. The ambiance was perfect for an intimate dinner. Great background music (a harpist was playing, but they also have a baby grand piano in the main dining room). The menu is not too large but not too small. <br><br>She had spaghetti and I had the Papa Sisto. Both excellent. The Papa sisto is a sausage and fettuccine dish and most places you will just get that cut up bratwurst type sausage. Not here. This was HOME MADE goodness.<br><br>Of course it is pricier, but for a date night, or a nice dinner out with friends...Check out Salvatore&#39;s.<br><br>We will be back.",
